<script>

/**
 * jQuery Plugin: Sticky Tabs
 *
 * @author Aidan Lister <aidan@php.net>
 * adapted by Ruben Arslan to activate parent tabs too
 * http://www.aidanlister.com/2014/03/persisting-the-tab-state-in-bootstrap/
 */
(function($) {
  "use strict";
  $.fn.rmarkdownStickyTabs = function() {
    var context = this;
    // Show the tab corresponding with the hash in the URL, or the first tab
    var showStuffFromHash = function() {
      var hash = window.location.hash;
      var selector = hash ? 'a[href="' + hash + '"]' : 'li.active > a';
      var $selector = $(selector, context);
      if($selector.data('toggle') === "tab") {
        $selector.tab('show');
        // walk up the ancestors of this element, show any hidden tabs
        $selector.parents('.section.tabset').each(function(i, elm) {
          var link = $('a[href="#' + $(elm).attr('id') + '"]');
          if(link.data('toggle') === "tab") {
            link.tab("show");
          }
        });
      }
    };


    // Set the correct tab when the page loads
    showStuffFromHash(context);

    // Set the correct tab when a user uses their back/forward button
    $(window).on('hashchange', function() {
      showStuffFromHash(context);
    });

    // Change the URL when tabs are clicked
    $('a', context).on('click', function(e) {
      history.pushState(null, null, this.href);
      showStuffFromHash(context);
    });

    return this;
  };
}(jQuery));

window.buildTabsets = function(tocID) {

  // build a tabset from a section div with the .tabset class
  function buildTabset(tabset) {

    // check for fade and pills options
    var fade = tabset.hasClass("tabset-fade");
    var pills = tabset.hasClass("tabset-pills");
    var navClass = pills ? "nav-pills" : "nav-tabs";

    // determine the heading level of the tabset and tabs
    var match = tabset.attr('class').match(/level(\d) /);
    if (match === null)
      return;
    var tabsetLevel = Number(match[1]);
    var tabLevel = tabsetLevel + 1;

    // find all subheadings immediately below
    var tabs = tabset.find("div.section.level" + tabLevel);
    if (!tabs.length)
      return;

    // create tablist and tab-content elements
    var tabList = $('<ul class="nav ' + navClass + '" role="tablist"></ul>');
    $(tabs[0]).before(tabList);
    var tabContent = $('<div class="tab-content"></div>');
    $(tabs[0]).before(tabContent);

    // build the tabset
    var activeTab = 0;
    tabs.each(function(i) {

      // get the tab div
      var tab = $(tabs[i]);

      // get the id then sanitize it for use with bootstrap tabs
      var id = tab.attr('id');

      // see if this is marked as the active tab
      if (tab.hasClass('active'))
        activeTab = i;

      // remove any table of contents entries associated with
      // this ID (since we'll be removing the heading element)
      $("div#" + tocID + " li a[href='#" + id + "']").parent().remove();

      // sanitize the id for use with bootstrap tabs
      id = id.replace(/[.\/?&!#<>]/g, '').replace(/\s/g, '_');
      tab.attr('id', id);

      // get the heading element within it, grab it's text, then remove it
      var heading = tab.find('h' + tabLevel + ':first');
      var headingText = heading.html();
      heading.remove();

      // build and append the tab list item
      var a = $('<a role="tab" data-toggle="tab">' + headingText + '</a>');
      a.attr('href', '#' + id);
      a.attr('aria-controls', id);
      var li = $('<li role="presentation"></li>');
      li.append(a);
      tabList.append(li);

      // set it's attributes
      tab.attr('role', 'tabpanel');
      tab.addClass('tab-pane');
      tab.addClass('tabbed-pane');
      if (fade)
        tab.addClass('fade');

      // move it into the tab content div
      tab.detach().appendTo(tabContent);
    });

    // set active tab
    $(tabList.children('li')[activeTab]).addClass('active');
    var active = $(tabContent.children('div.section')[activeTab]);
    active.addClass('active');
    if (fade)
      active.addClass('in');

    if (tabset.hasClass("tabset-sticky"))
      tabset.rmarkdownStickyTabs();
  }

  // convert section divs with the .tabset class to tabsets
  var tabsets = $("div.section.tabset");
  tabsets.each(function(i) {
    buildTabset($(tabsets[i]));
  });
};

</script>

<style type="text/css">
a.anchor-section {margin-left: 10px; visibility: hidden; color: inherit;}
a.anchor-section::before {content: '#';}
.hasAnchor:hover a.anchor-section {visibility: visible;}
</style>
<script>// Anchor sections v1.0 written by Atsushi Yasumoto on Oct 3rd, 2020.
document.addEventListener('DOMContentLoaded', function() {
  // Do nothing if AnchorJS is used
  if (typeof window.anchors === 'object' && anchors.hasOwnProperty('hasAnchorJSLink')) {
    return;
  }

  const h = document.querySelectorAll('h1, h2, h3, h4, h5, h6');

  // Do nothing if sections are already anchored
  if (Array.from(h).some(x => x.classList.contains('hasAnchor'))) {
    return null;
  }

  // Use section id when pandoc runs with --section-divs
  const section_id = function(x) {
    return ((x.classList.contains('section') || (x.tagName === 'SECTION'))
            ? x.id : '');
  };

  // Add anchors
  h.forEach(function(x) {
    const id = x.id || section_id(x.parentElement);
    if (id === '') {
      return null;
    }
    let anchor = document.createElement('a');
    anchor.href = '#' + id;
    anchor.classList = ['anchor-section'];
    x.classList.add('hasAnchor');
    x.appendChild(anchor);
  });
});
</script>

<style type="text/css">
.selectize-control.plugin-drag_drop.multi > .selectize-input > div.ui-sortable-placeholder {
visibility: visible !important;
background: #f2f2f2 !important;
background: rgba(0, 0, 0, 0.06) !important;
border: 0 none !important;
-webkit-box-shadow: inset 0 0 12px 4px #ffffff;
box-shadow: inset 0 0 12px 4px #ffffff;
}
.selectize-control.plugin-drag_drop .ui-sortable-placeholder::after {
content: '!';
visibility: hidden;
}
.selectize-control.plugin-drag_drop .ui-sortable-helper {
-webkit-box-shadow: 0 2px 5px rgba(0, 0, 0, 0.2);
box-shadow: 0 2px 5px rgba(0, 0, 0, 0.2);
}
.selectize-dropdown-header {
position: relative;
padding: 3px 12px;
border-bottom: 1px solid #d0d0d0;
background: #f8f8f8;
-webkit-border-radius: 4px 4px 0 0;
-moz-border-radius: 4px 4px 0 0;
border-radius: 4px 4px 0 0;
}
.selectize-dropdown-header-close {
position: absolute;
right: 12px;
top: 50%;
color: #333333;
opacity: 0.4;
margin-top: -12px;
line-height: 20px;
font-size: 20px !important;
}
.selectize-dropdown-header-close:hover {
color: #000000;
}
.selectize-dropdown.plugin-optgroup_columns .optgroup {
border-right: 1px solid #f2f2f2;
border-top: 0 none;
float: left;
-webkit-box-sizing: border-box;
-moz-box-sizing: border-box;
box-sizing: border-box;
}
.selectize-dropdown.plugin-optgroup_columns .optgroup:last-child {
border-right: 0 none;
}
.selectize-dropdown.plugin-optgroup_columns .optgroup:before {
display: none;
}
.selectize-dropdown.plugin-optgroup_columns .optgroup-header {
border-top: 0 none;
}
.selectize-control.plugin-remove_button [data-value] {
position: relative;
padding-right: 24px !important;
}
.selectize-control.plugin-remove_button [data-value] .remove {
z-index: 1;

position: absolute;
top: 0;
right: 0;
bottom: 0;
width: 17px;
text-align: center;
font-weight: bold;
font-size: 12px;
color: inherit;
text-decoration: none;
vertical-align: middle;
display: inline-block;
padding: 1px 0 0 0;
border-left: 1px solid rgba(0, 0, 0, 0);
-webkit-border-radius: 0 2px 2px 0;
-moz-border-radius: 0 2px 2px 0;
border-radius: 0 2px 2px 0;
-webkit-box-sizing: border-box;
-moz-box-sizing: border-box;
box-sizing: border-box;
}
.selectize-control.plugin-remove_button [data-value] .remove:hover {
background: rgba(0, 0, 0, 0.05);
}
.selectize-control.plugin-remove_button [data-value].active .remove {
border-left-color: rgba(0, 0, 0, 0);
}
.selectize-control.plugin-remove_button .disabled [data-value] .remove:hover {
background: none;
}
.selectize-control.plugin-remove_button .disabled [data-value] .remove {
border-left-color: rgba(77, 77, 77, 0);
}
.selectize-control {
position: relative;
}
.selectize-dropdown,
.selectize-input,
.selectize-input input {
color: #333333;
font-family: inherit;
font-size: inherit;
line-height: 20px;
-webkit-font-smoothing: inherit;

te with Turkish balamak.\n","Equivalent to ba (head) + -la. Cognate with Turkish balamak. Probably from Proto-Turkic, compare Chuvash  (pula, to start, transitive).\n","From bataq + -lq.\n","From Proto-Turkic *bat- (to sink; to fit into, get into). Cognate with Kazakh  (batw).\n","From Proto-Turkic *bk- (to look, watch). Cognate with Turkish bakmak, Crimean Tatar baqmaq, Turkmen bakmak.\n","From Proto-Turkic *bil- (to know)\nCognate with\nOld Turkic  (bil-, to know),\nTurkish bilmek,\nCrimean Tatar bilmek,\nUzbek bilmoq (to know).\nCrimean Tatar bilmek,\nKazakh  (bilw, to know),\nTatar  (bel)","Morphologically bimk (become cooked) + -ir (causative suffix). Cognate with Turkish piirmek (to cook), Kazakh  (pisirw, to cook), Tatar  (peer, to cook, to boil), Uyghur  (pishirmaq, to cook).\n","From Proto-Turkic *bt-, whence also btn (all, whole). Cognate with Turkish bitmek, Chuvash  (pt) etc.\n",null,null,"Ultimately from Sinitic .\n","From Proto-Turkic *ebir-. Cognate with Chuvash  (avrn).\n","From Common Turkic *ee. Cognate with Turkish ene, see there for more.\n","Borrowed from Persian  (angl).\n","From Proto-Turkic *r (rotten, foul; to rot; illness; dirt; to be sick, ill; rot; glue; anguish, sorrow), whence possibly also Azerbaijani irk (dirt). Cognate with Turkish rmek.\n","From Old Anatolian Turkish [script needed] (danmaq), ultimately a derivation of Proto-Turkic *tnu- (to know, get to know) , whence also Azerbaijani tanmaq. Cognate with Karakhanid  (tanumq, to talk to each other), Ottoman Turkish  (danmak, to advice, counsel).\n","From Proto-Turkic *dri (skin). Cognate with Turkmen deri, Turkish deri,\nKazakh i (teri),\nKarachay-Balkar  (teri), Kumyk  (teri), Kyrgyz  (teri),\nUzbek teri,\nUyghur  (tre),\nYakut  (tirii), Dolgan , Tatar  (tire) and\nBashkir  (tire).\n","From Proto-Turkic *dil, *dl (tongue; language). Cognate with Turkish dil.\n","From Proto-Turkic *tog-. Cognate with Old Turkic [script needed] (tugur-, to give birth to), Uzbek tugmoq (to give birth to), Chuvash  (tu).\n","From Proto-Turkic *duj- (to perceive (by ears or nose), notice). Cognate with Turkish duymak.\n","From Proto-Turkic *t (even, level).\n","From Proto-Turkic *it-. Cognate with Turkish iitmek, Kazakh  (estw), Uzbek eshitmoq.\n","From Proto-Turkic *t-. Cognate with Old Turkic  (et-, to make), Turkish etmek.\n","From Proto-Turkic *eb (dwelling place, house). Cognate with Old Turkic  (eb), Turkish ev.\n","From  Proto-Turkic *ri-. Cognate with Turkish erimek.\n",null,"Ultimately from Proto-Turkic *k(y)t- (to go (away), to get away).\n","From Proto-Turkic *kr- (to enter). Cognate with Old Turkic  (kir- /kir/), Turkish girmek, Chuvash  (kr) etc.\n","From gizlmk + -t.\n","From gr (to see) + -n ([passive suffix]). Compare Turkish grnmek.\n","From Proto-Turkic *kk (blue, green).\n","From Arabic  (haw).\n",null,"From Proto-Turkic * (work, deed).\n","From Persian  (kenr).\n",null,"From Arabic  (masfa).\n",null,"Cognate with Turkish demek, etc.\n","From Proto-Turkic *bl- (to become). See there for cognates.\n","From Proto-Turkic *rt- (to cover), whence also Azerbaijani rpk (headscarf).\nCognate with Turkish rtmek (to cover, shut), Chuvash  (vitme, to cover, protect, close), etc.\n","From Proto-Turkic *ol-tur- (to sit), causative of *ol-.\n","From Proto-Turkic *ok-.\n","Ultimately from Proto-Turkic *oj- (to play, to jump), whence also the derivation oyun (play, game). Cognate with\nTurkish oynamak,\nTurkmen onamak,\nCrimean Tatar oynamaq,\netc.\n","Ultimately from Proto-Turkic *- (to think of, understand, realize), and its derivations, such as Proto-Turkic *g (mind, thought, intelligence), and Proto-Turkic *gre-, its reflexive form. Cognate with Turkish retmek (to teach) and Turkish renmek (to learn). See there for more.\n",null,"From Proto-Turkic *bu-, *bo- (to damage, destroy).\nCognate with Turkish bozmak, Chuvash  (ps, break, destroy), etc.\n","From Proto-Turkic *kpuk (bark; skin; shell).\n","From Common Turkic *ka- (to run away, flee). Cognate with Turkish kamak etc.\n","Morphologically from qalxmaq (to rise) + -dr, with /x/ in qalxmaq being lost via syncope. Cognate with Turkish kaldrmak.\n","From Proto-Turkic *kagan, compare Chuvash  (huran).\n","From Proto-Turkic *kr- (to break, demolish; small; to scrape, shave). Compare Azerbaijani qrxmaq (to shave) which is probably a derivation from the same root. Cognate with Turkish krmak etc.\n","From Proto-Turkic *k (girl, woman). Cognate with Bashkir  (q), Crimean Tatar qz, Karakalpak qz, Kazakh  (qz), Kyrgyz  (kz), Old Turkic [script needed] (kz), Ottoman Turkish , Tatar  (qz), Turkish kz, Turkmen gyz, Tuvan  (ks), Uyghur  (qiz), Uzbek qiz.\n","From Proto-Turkic *kol (upper arm). Cognate with Turkish kol, Crimean Tatar qol etc.\n","From qop- (to break off) + -ar","Form Common Turkic *kr-. Cognate with Old Turkic [script needed] (kor-, to protect), Uzbek qorimoq (to protect).\n","Likely from Proto-Turkic. Cognates include Turkish korkmak, Kazakh  (qorqw), Uzbek qorqmoq, Chuvash  (hra).\n","From Proto-Turkic *ko-. Cognate with Old Turkic [script needed] (kd-), [script needed] (kt-, to put, to set down, to lay, to place), Turkish koymak, etc.\n","From Proto-Turkic *krt.\n","From Arabic  (ab).\n","From Old Anatolian Turkish [script needed] (sakla-, to guard, protect), ultimately from Proto-Turkic *sk (aware, alert). Cognate with Turkish saklamak.\n","Ultimately from Arabic  (ay).\n","From Proto-Turkic *ses. Cognate with Turkish, Crimean Tatar, Gagauz, Turkish ses, Kazakh  (ses), Chuvash  (sas).\n","From sn- (to break) + -dr (causative).\n","From Proto-Turkic *so (back, end). Compare Turkish son below.\n","A derivation of Proto-Turkic *so (end), whence also son. Cognate with Turkish sonra etc.\n","From Proto-Turkic *sok- (to pierce, stick into), which was homonyms to and possibly cognate with Proto-Turkic *sok- (to hit, beat, crush). Compare Karakhanid  (suqmq), Turkish sokmak (to insert), etc.\n","From Proto-Turkic *sog-k. Cognate with Turkish souk, Uzbek sovuq, Bashkir  (hwq), Chuvash  (siv) etc.\n","From Proto-Turkic. Cognate with Turkish sprmek, Chuvash  (pr, broom).\n","Ultimately from Proto-Turkic *sr-, cognate with Turkish srmek.\n","Cognate with Old Turkic [script needed] (srg).\n",null,null,null,"From Proto-Turkic *tep.\n","From Proto-Turkic *dik- (vertical; to to plant vertically).\nCompare Turkish dikmek (to sew), Kumyk  (tikmek, to sew; to build) Kazakh  (tigw).\n","From Proto-Turkic *tut- (to grasp).\nCognate with Old Turkic  (tut-, to keep, catch, own), Turkish tutmak (to catch, keep), Bashkir  (totou, to keep, hold), Chuvash  (tytma, to keep, hold), Khakas & Shor  (tudara, to keep, hold, catch, seize, rule, hold back), Kyrgyz  (tutuu, to catch), Turkmen tutmak (to hold, keep, catch, hire, fill), Tuvan  (tudar, to hold, catch, grab), Uzbek tutmoq (to take, hold, catch), Yakut  (tut, to hold, seize, grab, catch).\n","From Proto-Turkic *u-n, *ua-k (long, far, late), whence also uzaq (far, distant).\n","Ultimately from Proto-Turkic *br- (to give). Cognate with Old Turkic [script needed] (ber-, to give), Turkish vermek, etc.\n","Ultimately from Arabic  (abar).\n","From Proto-Turkic *yg.\n","Morphologically from yanmaq (to burn) + -dr","Ultimately from Proto-Turkic *y (young, fresh).\n","From Common Turkic *ya-, a derivation from Proto-Turkic *y.\n","From Proto-Turkic *yy (summer).","From yell- + -n.\n","From Proto-Turkic *y-. Cognate with Old Turkic [script needed] (ye-, to eat), Turkish yemek, etc.\n","Ultimately from Proto-Turkic *yr. Cognate with Old Turkic  (yer),  (yir).\n","From Proto-Turkic *uya. Cognate with Chuvash  (jva).\n","From Proto-Turkic *adak (leg); however, not a regular Kypchak development thereof (which is  (ayaq)), but apparently a (now extinct) collateral branch with a peculiar semantic shift.\n","From Proto-Turkic *(k) (moon, month).\nCognate with Azerbaijani ay, Turkish, Crimean Tatar ay, Tatar, Kazakh, Kyrgyz (ay), Southern Altai  (ay), Uzbek oy, etc.\n",null,"From Proto-Turkic *l- (to take).\nCognate with Old Turkic [script needed] (al-, to take); Turkish almak, Yakut  (l, to take), Chuvash  (il, to take), etc.\n","From Proto-Turkic *la- (to understand), from Proto-Turkic * (intelligence, mind).\nCognate with Old Uyghur [script needed] (ala-, to understand); Kyrgyz  (adoo, to understand), Karachay-Balkar  (alara, to understand), Uzbek anglamoq (to understand), Uyghur  (anglimaq, to listen; to understand), Turkish anlamak (to understand), Azerbaijani anlamaq (to understand).\n",null,"From Proto-Turkic *agr-g (pain, illness), an action noun of *agr- (to ache; be ill).\nCognate with\nKarakhanid  (ar, pain),\nOld Uyghur qryq (ar, pain, illness),\nKazakh  (awrw, illness; ill; to be ill), Kyrgyz  (ooru), Southern Altai  (ooru),\nUzbek ogriq (pain, ilness),\nUyghur  (aghriq, illness),\nKhakas  (ar, illness; ill),\nTuvan  (aarg, illness, pain),\nYakut  (ar, pain, disease),\nTurkish ar (pain, ache).\n","From Proto-Turkic *(i)a-a- (to eat), from Proto-Turkic *(i)a (food, meal).\nCognate with\nOld Uyghur [script needed] (aa-, to eat);\nKumyk  (aamaq, to eat);\nKarachay-Balkar  (aara, to eat);\nYakut  (ahaa, to eat), etc.\n",null,"From Common Kypchak *ayaq, from Proto-Turkic *adak (foot, leg).\nCompare Old Turkic  (adaq, leg, foot).\nSee also  (aaq).\n",null,"From *ayt- (to say, utter), from Proto-Turkic *ayt- (to say; ask), which (as seen in Old Uyghur, Yakut, Chuvash cognates) was originally a causative form of an earlier *ay- (to say).\nCompare to\nTatar  (yt, to say),\nKazakh  (aytw, to say),\nKyrgyz  (aytuu, to say),\nCrimean Tatar aytmaq (to say),\nUzbek aytmoq (to say),\nUyghur  (ytmaq, to say),\nKumyk  (aytmaq, to say),\ndialectal Khakas - (ayt-, to say), - (ayt-, to sing),\nTurkish aytmak (to say);\nOld Uyghur [script needed] (ajt-, to have/make/let sb. say),\nYakut - (yt-, to ask),\nChuvash  (yjt, to ask).\n","From Proto-Turkic *ig (bitter, acid).\nA palatal parallel development, compare Bashkir  (as, bitter, sour) from the same archetype.\n",null,"From Proto-Turkic *bat-gak (sticky mud, bog), from *bat- (to sink, get bogged/stuck in mud).\nCognate with\nKazakh  (batpaq),\nKyrgyz  (batkak),\nShor  (patqaq),\nKarachay-Balkar  (batxaq, clay, mud),\nUzbek botqoq,\nUyghur  (patqaq, sticky mud, bog),\nTurkmen batga (swamp, bog),\nTurkish batak (swamp, bog).\n","From Common Kypchak *baw, from Common Turkic *b (rope, binder), from Proto-Turkic *b(i)- (to bind, fasten).\nCognate with\nOld Uyghur [script needed] (ba, band, binder; bond);\nKazakh  (baw, cord, binder),\nKyrgyz  (boo, cord, binder),\nSouthern Altai  (buu, cord),\nCrimean Tatar bav (knot),\nUzbek bog (cord; bundle),\nTurkish ba (connection),\nYakut  (ba, cord, lace), etc.\n",null,null,null,"From Proto-Turkic *br (one).\nCognate with\nOld Turkic  (bir, one), Turkish bir (one, once).\n",null,null,"From Proto-Turkic *br- (to give).\nCognate with Old Turkic - (br-, to give);  Turkish vermek, Yakut  (bier), Chuvash  (par, to give), etc.\n",null,"Cognate with\nKarakhanid [script needed] (butaq, branch, twig);\nKazakh  (butaq),\nKyrgyz  (butak),\nSouthern Altai  (budak, branch, twig),\nUzbek butoq (branch, twig), etc.\n",null,"From Proto-Turkic *bl- (to become).\n",null,null,"From Persian  (dorost, correct).\n",null,"From *yebi() (wet), from Proto-Turkic *yebi- (to soak, become wet).\nCognate with Tatar  (yuye, wet), Karaim  /  /  /  (wet).\n","From Common Kypchak *egin \"grain crop\", from *ekin \"cultivated land; crops grown on such land\"; from  Proto-Turkic *ek- (to sow).\nCognate with\nOld Uyghur [script needed] (ekin, arable land, tilled land);\nKazakh  (egin, grain crops),\nKyrgyz  (egin, grain crops),\nUzbek ekin (farm crop),\nUyghur  (kin, arable land; farm crop),\nTurkish ekin (farm crop).\n","The only reliable cognate is Kazakh  (enw, to enter, go in). Thus, this is a very peculiar regional feature shared by only these two languages.\nGenerally thought to derive from Proto-Turkic *n- (to go down),.\nHowever, no adequate explanation has been presented as to how this peculiar semantic transformation (\"go down\" > \"enter\") could have taken place, and why only in these two languages but not elsewhere.\n","From Proto-Turkic *r (man).\n",null,"From  Proto-Turkic *it- (to hear).\nCognate with Old Turkic  (eit-, to hear, listen);  Kazakh  (estw, to hear), Uzbek eshitmoq (to hear), Turkish iitmek (to hear), Khakas  (isterge, to hear),Yakut  (ihit, to hear), Chuvash  (iltme, to hear).\n","From Proto-Turkic *y (young).\n","From Common Turkic *ya- (to live), a derivation of Proto-Turkic *y.\nCognate with\nOld Uyghur [script needed] (jaa-, to live);\nKazakh  (jasaw, to live), \nKumyk  (yaamaq, to live), \nUzbek yashamoq (to find), \nUyghur  (yashimaq, to live), \nSouthern Altai - (aa-, to live (up to a certain age)),\nKhakas  (azira, to live (up to a certain age)), \nTurkmen aamak, Turkish yaamak (to live).\n",null,"From *dkla- (to sleep), from  *dk \"sleepy\", derived from *d- 'to sleep', which in turn derives from * \"sleep\".\nCognate with\nKazakh  (uyqtaw), Kumyk  (yuxlamaq), Crimean Tatar yuqlamaq, Kyrgyz - (ukta-), Southern Altai  (uyuktaar), Chulym - (uqla, to sleep), Uzbek uxlamoq, Uyghur  (uxlimaq),\nTurkmen uklamak (to sleep).\n",null,"From Proto-Turkic *yln (snake).\nCognate with\nOld Turkic [script needed] (jlan, snake);\nKazakh  (jlan), Kyrgyz  (clan),\nUzbek ilon,\nUyghur  (yilan),\nTurkish ylan,\nKhakas, Tuvan  (lan, snake), etc.\n",null,null,null,null,null,"From *krek (shovel, spade), from Proto-Turkic *kre- (to shovel, rake up).\nCognate with\nKazakh  (krek),\nKyrgyz  (krk),\nKarachay-Balkar  (krek),\nKumyk  (krek),\nUzbek kurak,\nSouthern Altai  (krek), Shor ,\nTurkish krek,\nCrimean Tatar krek,\nAzerbaijani krk (shovel; spade).\n","From Common Turkic *k (force).\n","From *klg \"strong\" (compare Old Turkic  (klg, strong, mighty)), from Common Turkic *k (force) + +lg \"affix of possession or quality\".\nSynchronously, equivalent to  (ks) + - (-l).\nCognate with\nTatar  (kle),\nCrimean Tatar kl,\nUzbek kuchli,\nUyghur  (kchlk),\nTurkmen gli,\nTurkish gl (strong), etc.\nSee more cognates at  (kst).\n","From Proto-Turkic *gd- (to wait; to attend; to respect; to herd).\nCognate with\nOld Uyghur [script needed] (kt-, to wait; to herd);\nKazakh  (ktw, to wait),\nKyrgyz  (kt, to wait; to tend to (cattle)),\nUzbek kutmoq (to wait; to tend to (guests)),\nUyghur  (ktmek, to wait),\nYakut - (kt-, to wait) / - (kht-, to wait),\nChuvash - (kt-, to wait; to herd).\n","From  Proto-Turkic *gr- (to see).\nCognate with Old Turkic  (krr, seeing); Kazakh  (krw, to see), Kyrgyz  (kr, to see), Southern Altai  (krr, to see), Uzbek kormoq (to see), Khakas  (krerge, to see), Tuvan  (kr, to see), Azerbaijani grmk (to see), Turkish grmek (to see),   Yakut  (kr, to see), Chuvash  (kurma, to see).\n",null,null,"From Proto-Turkic *kpuk (bark; skin; shell).\nCognate with\nKazakh  (qabq),\nKyrgyz  (kabk), Southern Altai  (kabk),\nUzbek qobiq (skin, shell),\nTurkish kabuk (shell),\nTuvan  (xavk, husk),\nChuvash  (hup, bark),\netc.\n",null,null,"From *qayda \"where, at what place\", from Proto-Turkic *ka- (interrogative particle). -da is a locative case formant.\nCognate with\nOld Turkic [script needed] (qajda, where?),\nTatar  (qayda),\nOttoman Turkish  (kanda),\nKazakh  (qayda),\nKyrgyz  (kayda),\nCrimean Tatar qayda,\nShor ,\nKhakas  (xayda),\nTuvan  (kayda),\netc.\n","From Proto-Turkic *kad (rawhide; belt).\nCognate with\nOld Turkic [script needed] (qa, belt);\nKazakh  (qays, rawhide);\nKyrgyz  (kay, belt),\nSouthern Altai  (kay, belt)Uzbek qayish (belt),\nKhakas  (xaas, belt),\nYakut  (xats, leather strap/belt),\netc.\n",null,null,"From *qara- (to look), probably borrowed from Middle Mongolian, from Proto-Mongolic *kara- (to look).\nCognate with Kazakh  (qaraw, to look), Kyrgyz - (kara-, to look), Southern Altai - (kara-, to look), Uzbek qaramoq (to look), \nUyghur  (qarimaq, to look), Khakas - (xara-, to look).\n",null,"from Common Turkic *xtun (queen).\nCompare Old Turkic  (qatun, queen), Karakhanid  (qtn, noble woman), Turkish kadn (woman).\n",null,null,"From Proto-Turkic *kol (upper arm, hand).\nCognates include\nOld Uyghur qwl (qol, arm);\nTatar  (qul, arm, hand),\nKazakh  (qol, arm, hand),\nUzbek qol (arm, hand),\nTurkish kol (upper arm),\nYakut  (xol, upper arm),\nChuvash  (hul, arm; shoulder).\n",null,"From Proto-Turkic *k (girl).\nCognate with\nOld Turkic  (qz, girl);\nKyrgyz  (kz),\nShor ,\nTurkish kz (girl), etc.\n",null,"Cognate with\nTatar  (may),\nKazakh  (may),\nKyrgyz  (may),\nUyghur  (may, oil, butter, fat, grease).\n","Cognate with Tatar  (matur, beatiful) and Chuvash  (mattur, strong, stout; dextrous; brave; beatiful).\nUltimately from Proto-Turkic *bagatur (hero).\nIrregular nasalization and preservation of a roundness-disharmonic high vowel are sporadically found in inherited vocabulary but could also indicate some sort of reloaning scenario.\nDoublet of  (batr, hero, brave).\n",null,"From Proto-Turkic *b (corner).\nCognate with\nSiberian Tatar  (my, corner),\nKarakalpak  (corner),\nKazakh i (myis, corner),\nKarachay-Balkar  (my, corner).\n","Cognate with\nKazakh  (mltq),\nNogai  (mltk),\nUzbek miltiq,\nUyghur  (miltiq),\nKyrgyz  (mltk),\nSouthern Altai  (mltk),\nKhakas  (mltx, rifle), etc.\n",null,"From Persian  (ust) /  (ostd). Doublet of  (ostaz).\nNote that the first form in Persian may have been reborrowed from a Turkic source.\nCognate with\nTatar  (osta, master, craftsman),\nKazakh  (usta, master; blacksmith),\nKyrgyz  (usta, master; blacksmith),\nUzbek usta (master, professional),\nUyghur  (usta, master, professional),\nTurkish usta (master).\n",null,"From Common Kypchak y (\"house, home\", see the Kypchak cognates below), from Proto-Turkic *eb (house).\nImmediately cognate with Tatar  (y), Kazakh  (y), Kyrgyz  (y), Karachay-Balkar  (y), Kumyk  (y), Southern Altai  (y, home, house).\n",null,null,null,null,null,"From *et (edge, border; a location aside/away from sth.; foreign).\nCognate with\nKazakh  (et, edge),\nKyrgyz  (et, edge),\nUzb omplete. You can help Wiktionary by elaborating on the origins of this term.",null,"From Proto-Nakh *xi.\n",null,null,null,null,null,null,null,null,null,null,null,"From Proto-Nakh *ca.\n","From Proto-Nakh *ce (name).\n",null,null,null,null,null,null,"From Proto-Nakh *jobq.\n",null,null,null,"Borrowed from Russian  (obed).\n","Related to Tatar  (apa), from Old Turkic apa.\n",null,null,null,null,null,null,null,null,null,null,null,null,"Compare Tatar  (ut).\n",null,null,null,null,null,null,null,null,null,null,"From Proto-Turkic *kk.\n",null,null,null,null,null,"From Proto-Turkic *gr- (to enter). Cognate with Old Turkic  (kir- /kir/), Turkish girmek, Azerbaijani girmk etc.\n",null,null,null,"From Proto-Turkic *gl. Cognate with Turkish and Azerbaijani -gil (someone's home or family), Yakut  (kle, entrance hall).\n",null,null,null,null,null,null,null,null,null,null,"From Proto-Turkic *bu- / *bo- (to damage, destroy). Cognate with Azerbaijani pozmaq, Bashkir  (boou).\n",null,null,"Related to Turkish bulut and Yakut  (plt), from Proto-Turkic *bult, .\n",null,null,null,null,"From Proto-Turkic *biarak.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Turkic *y. Cognate with Turkish yaz (summer).\n",null,null,null,null,null,null,null,null,"Historically from  (tv) (<  (taw) <  (tau)), from Proto-Turkic *tg.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Turkic *k, compare Turkish kaz.\n",null,null,null,null,null,null,"From Proto-Turkic *dl.\n",null,null,null,"From Proto-Turkic *dik- (vertical; to to plant vertically).\nCompare Azerbaijani dikmk (to bury) dik (upright, vertical), tikmk (to sew); Turkish dikmek (to sew), Kumyk  (tikmek, to sew; to build) Kazakh  (tigw).\n",null,"Related to Turkish di.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Chukotko-Kamchatkan *l (finger). Compare also Koryak , Alutor  and Itelmen .\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Cognate with Japhug amdz (Zhang, Jacques, and Lai, 2019).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Simplified from  (  ). Note that  changed from being on the left to being , underneath. Compare  (from ), which retains the , and , which is the simplification in isolation.\nCurrent form is graphically  + .\n",null,null,null,null,null,null,"From Proto-Sino-Tibetan *m-kul (twenty; all); cognate with  (OC *kun, swarming), Tibetan  (kun, all), Burmese  (a.kun, all) (Benedict, 1972; STEDT).\n",null,null,"From Proto-Sino-Tibetan *m/g-(r)wa-/k/t (horn; angle; corner) (STEDT). Cognate with Tibetan  (rwa, horn), Garo grong (horn), Jingpho nrung (n u, horn), Chepang  (ro, horn),  (OC *kra, antler). The Tibeto-Burman *- final variant is reflected in  (OC *kra, drinking vessel made from animal horn) (Schuessler, 2007). Possibly also related to  (OC *bro, deer) (Sagart, 1999).\nA derivative is  (stuffed dumpling), named for its horn-like shape (Norman, 1988).\nIt is probably unrelated with Proto-Indo-European *rhns (horn) ( < *erh- (horn)) and Proto-Semitic *arn- (horn) despite the phonological and semantic resemblance between the three.\n",null,null,null,null,null,null,null,null,"Proto-Celtic *baw. Compare French boue (mud), from Gaulish *bau.\n","From berw (boiling) + -i.\n",null,null,"From Middle Welsh bwrt, from Old English bord (compare Irish bord); doublet of bord.\n",null,"From Proto-Brythonic *catarno, from Proto-Celtic *katus (battle). See cad.\n",null,"From cau + -ad.\n","From cangau, plural of cainc (branch) (from Proto-Celtic *kank),  + -en (singulative suffix).",null,"From casgl (collection) + -u.\n","Cognate with Cornish gwari and Breton c'hoari.\n",null,null,"Cognate with Cornish kelmi, Breton koulma.\n","From Proto-Brythonic *klwid, from Proto-Celtic *klusti, from Proto-Indo-European *lew-.\n","Clipping of cyfodi, from cyf- + odi.\n",null,"From Proto-Celtic *koudeti, from Proto-Indo-European *(s)kewd- (to cover, wrap, encase),  + -io (forming verbnouns). Cognate with Cornish cuthe, Breton cuzaff, English hide, Latin custs, Ancient Greek  (keth, to conceal), Sanskrit  (kuharam, cave).\n","From cwymp.\n","From cyf- + rhif.\n",null,null,"From Proto-Brythonic *dalg-, from Proto-Indo-European *delg-. Cognate with Latin indulgeo.","Contraction of older deau (right; south), from Proto-Celtic *dexsos (right). Cognate with Cornish dyhow, Breton dehou, Irish deas, Scottish Gaelic deas, Manx jiass.\nThe sense \"south\" comes from the fact that the south is on the right-hand side of a person facing east.",null,null,null,null,"Borrowed from Latin disc (I learn). Cognate to Breton deski and Cornish dyski, from the same origin.\n",null,"Borrowed from Old English ford","Ultimately from Proto-Indo-European *eh- (to leave behind, abandon).",null,"From gorchudd + -io.\n","From Old Welsh guor (over) + phenn (head) (see penn).\nCognate with Cornish gorfedna, Breton gourfenna.\n","From Proto-Celtic *uo-stut (see go-), from Proto-Indo-European *steh-.","From Proto-Celtic *grendsmu, from Proto-Indo-European *gred-. Cognate with Latin gradus (step).\n",null,"The variant gwddwg is cognate with Old Breton guodoc (Middle Breton gouzouc, Breton gouzoug, gog), but it is difficult to explain the alternation between -wg, -w, and -f. The oldest form of the word cited in Geiriadur Prifysgol Cymru is the Middle Welsh plural form gedueu (13th century; = modern gyddfau), while the soft mutation forms wwc, wddf, and wddw are all attested in the 14th century, indicating that the alternation is very old.\n",null,"Back-formation from gwneuthur, from Middle Welsh gwneuthur, altered from *gwreithur with -n- from gwno (to sew), from Proto-Celtic *wregeti (compare Cornish gwra (he does, makes), Breton gra (he does, makes), Old Irish fairged (they made)), from Proto-Indo-European *wer- (compare English work). Middle Welsh preserved the -r- in the preterite: gwreith (I did, made), goruc (he did, made).\n",null,"gwth + -io","From gyr (drive, thrust; flock, drove) + -u.\n",null,null,null,null,"Cognate with Breton moan, Cornish moon.\n",null,"Ultimately from Proto-Indo-European *med- (measure; advise).This etymology is incomplete. You can help Wiktionary by elaborating on the origins of this term.",null,"Suppletive verb; verbal noun from Middle Welsh mynet, from Proto-Brythonic *moned (compare Cornish mones, Breton mont), verbal noun of Proto-Celtic *montor (compare Middle Irish muinithir (goes around)), from Proto-Indo-European *menH- (compare Umbrian menes (will come), Lithuanian mnti (to trample, scutch)). Indicative forms from Proto-Celtic *ageti (to drive) (compare Old Irish aigid), from Proto-Indo-European *he- (compare Latin ag). The forms in el- are from Proto-Celtic *el- (to approach, drive), from Proto-Indo-European *pelh- (compare Latin pell (strike, drive), Epic Greek  (plnamai, approach).\n",null,null,"From pell (far (away), distant, remote) + -ter.\n",null,null,"From Latin prob (to test).\n","pwdr + -u. Cognate with Cornish pedri.\n",null,"From rhuthr (rush, noun) + -o, ultimately from Proto-Indo-European *hrew- (to hurry). Cognate with Middle Irish ratharaigid (makes a rush or onset), from rathar, rathurm (onrush, onset, attack).",null,"From sain + -io.\n",null,"sych (dry) + -u.\n","Ultimately from Proto-Indo-European *terh- (to rub, turn; pierce).",null,"According to Matasovic, from a non-Indo-European language, but Pokorny suggests Proto-Indo-European *terk- (to twist, spin).  Cognate with Cornish terri, Breton torri.\n","From tro + -i.\n","Perhaps ultimately from Proto-Indo-European *ten- (stretch, extend).","From ym- + gadael (leave)","From ym- + dangos.\n","See ym-. Cognate with Irish imeall.",null,"From ysgub + -o.\n",null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)","From Old Norse annarr, from Proto-Germanic *aneraz (second, other).\n",null,"From Old Danish athr, Old Norse dr, from Proto-Germanic *r (vein). Related to German Ader.\n","Equivalent to be- + tale (to speak), from Middle Low German betalen, compare German bezahlen. A compound with the Germanic verb *taln (to tell; to count).\n","Borrowed from Middle Low German bliven, from Old Saxon bilan, from Proto-Germanic *bilban, cognate with German bleiben (to remain). In the sense to become\", it has replaced older vorde.\n","Derived from the verb.\n",null,"From Old Danish fange, borrowed from Middle Low German vangen (to catch), from vn, from Proto-Germanic *fangan. Doublet of f (to get).\n","Older Danish farge, from Middle Low German varwe, verwe, from *Old Saxon farwi, *farawi (colour), from Proto-Germanic *farw, from Proto-Indo-European *per-, *per- (motley, coloured). Cognate with Old High German farawa (color) (German Farbe), Old High German faro (colored), Latin pulcher (beautiful, sheen), Ancient Greek  (perkns, multicolored), Old Irish earc (spotted).\n","From Old Danish feye, borrowed from Middle Low German vegen, from Proto-Germanic *fegn, cognate with Old High German vegn, German fegen. Usually associated with Old Norse fga (to adorn, polish), Middle Low German vgen, from Proto-Germanic *fgn, but the details are unclear.\n","From Middle Low German vluchten, compare German flchten. Derived from the noun Danish flugt, from Middle Low German vlucht, from Proto-Germanic *fluhtiz (flight), cognate with English flight and German Flucht.\n",null,null,null,"A merger of two related verbs: 1. Old Norse hengja (to hang (transitive)), from Proto-Germanic *hangijan, cognate with German hngen; and 2. Old Norse hanga (to hang (intransitive)), from Proto-Germanic *hanhan, cognate with English hang and German hangen. In the past tense, Danish still distinguishes transitive hngte from intransitive hang (though they are often mixed up).\n",null,"Likely related to nppe (hardly at all)",null,"From Middle Low German lren, from Proto-Germanic *laizijan, cognate with German lehren (teach), Dutch leren, and Gothic  (laisjan). Late Old Norse lra, Norwegian lre, and Swedish lra are also borrowed form Low German.\n",null,null,"From Old Norse regna, from Proto-Germanic *regnn, cognate with English rain and German regnen. Derived from the noun *regn, cf. Danish regn.\n",null,null,null,null,"Compare German schlimm.\n",null,null,null,"From st (stand) and op (up). Compare opst.\n","From Middle Low German stecken, from Old Saxon stekan.\n",null,null,"From Old Danish siunk, from Old Norse *sinkwa (east) / skkva (west), from Proto-Germanic *sinkwan, cognate with Swedish sjunka, English sink, German sinken, Dutch sinken, Gothic  (sigqan).\n",null,"From Old Danish wogge, from Old Norse vagga (accusative, dative, genitive vggu), cognate with Swedish vagga. Derived form the verb vaga (see the following word).\n",null,null,null,"From Proto-Mongolic *arca, compare East Yugur hrca (cypress).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Finno-Ugric *kte.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Compound of an- (on, at) + znden (to ignite, kindle). Akin to Old English ontendan, Swedish antnda, Norwegian antenne.\n",null,"From a Baltic language. Compare Old Prussian ansis (hook, latch) and Latvian osa. Cognate to Finnish ansa and Votic aasa.\n","From abi + kaasa.\n","From Proto-Finnic *alla.\n",null,"From erk (alert, noun), see there for further etymology. Compare Finnish hert.\n",null,null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)\nRelated to Finnish enne.\n","Allegedly coined ex nihilo by Johannes Aavik in the 20th century, but compare Finnish esine.\n","Cognate to Votic li and Livonian . Possibly a cognate to Finnish ni, in which case the sound change n -> l would have happened in Estonian, Votic and Livonian.\n","Possibly from Proto-Germanic *hakkn. Alternatively of Baltic origin; compare Latvian skt (to start) and Lithuanian okti.\n","Onomatopoeic, from heli. Cognate with Finnish helist, Veps helit and Votic elis.\n",null,null,null,null,null,null,null,null,null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,"Possibly from Proto-Finnic *koneh (magic) (whence Karelian koneh (magic), Finnish kone (machine, trick)).\n",null,null,null,null,null,null,null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)\nRelated to Finnish langeta.\n",null,nu ncient Greek  (telei), contracted form of  (telei, complete, make perfect) + - (-no, suffix for verbs).",null,"Inherited from Ancient Greek  (trkh), from Proto-Indo-European *dreg- (to run).\n",null,null,"Derived from forms of Ancient Greek  (phagon, I ate).\n",null,"From Ancient Greek  (phr) with addition of a nasal infix, from Proto-Hellenic *pr, from Proto-Indo-European *breti.\n","From Ancient Greek  (pheg, flee) (the sense \"leave\" since mediaeval times. From Proto-Hellenic *pug, from Proto-Indo-European *bewg-. Has been displaced by  (drapetvo) in the Ancient Greek sense of \"to flee\".\n","From Ancient Greek  (phlos), probably from a Proto-Hellenic *plos, from Proto-Indo-European *bil-o-s, from *bil- (decent, good, harmonious, friendly).\n",null,"From Ancient Greek  (pturion).\n","Inherited from Ancient Greek  (phus), contracted form of  (phus). Also see the modern  (fyso)",null,"Inherited from Ancient Greek  (khelos).\n","From Ancient Greek  (khrnos).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Persian  (peri).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Middle English comb, from Old English camb (comb), from Proto-Germanic *kambaz (comb) (compare Saterland Frisian Koum, Swedish/Dutch kam, Norwegian kam, German Kamm), from Proto-Indo-European *mbos (tooth), from Proto-Indo-Eu tu. Compare with French jeter un il.\n",null,null,null,null,null,null,null,null,null,null,"Unknown.",null,"From Proto-Basque *e(H)u, itself perhaps from Gothic   (ain hund).\n",null,"Unknown. Often compared with Iberian erder (half). For the meaning to give birth, compare the semantic field of Latin pars (part) and the correspondent verb parere (to give birth).\n",null,null,null,null,null,null,"Originally attested as etse, itself of unknown origin.",null,null,null,null,null,"Of native origin, probably a reduplicated form of an ancient root. \n",null,null,null,null,null,null,null,"Perhaps from Occitan eigau (south wind bringing rain), from Latin aqulem (watery), from aqua, from Proto-Italic *ak, from Proto-Indo-European *hkeh. \n",null,"From Proto-Basque *hei (town, inhabited place, people, nation).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Basque *lu. \n",null,null,null,null,null,null,"From Proto-Basque *su. \n","Unclear. Apparently from ur (water) + -din (resembling), although the normal morphophonological rules would yield *udin.",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Tungusic *gara, cognate with Even  (gar), Nanai  and Manchu  (gargan) etc.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Tungusic *aa (clear sky). Cognate with Even  (ain), Manchu  (niyangniya, clear sky), etc.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Finnic *ni, from Proto-Finno-Ugric *ne; cognate with Hungarian nek. The meaning \"vote\" is a semantic loan from  Swedish rst.\n","From Proto-Finnic *ajadak, from Proto-Finno-Ugric *aja-. Cognates include Estonian ajama and Northern Sami vuodjit. Likely an old loan from Indo-Iranian: compare Sanskrit  (jati), further also Latin ag and Ancient Greek  (g) (likewise from Proto-Indo-European *he-).\n",null,null,null,null,null,null,"From Proto-Finnic *jalka, from Proto-Finno-Ugric *jalka.\n","From Proto-Finnic *jttdk. Equivalent to j + tt.\n","Originally a passive verb, derived from joutaa + -ua.\n",null,null,null,null,"From Proto-Finnic *kaccodak. Cognate to Estonian katsuma.\nUncertain etymologies from Proto-Germanic *ganhatjan (compare Icelandic gta (watch over, look after)) and Proto-Finno-Permic *kae- (compare Komi-Zyrian  (kazjavny)).\n","From Proto-Finnic *kveldk. Equivalent to kyd + -ella.\n","From Proto-Finnic *keeli, from Proto-Uralic *kle. Cognates include Estonian keel and Northern Sami giella.\n","kiire + -hti","koh- + -ista; of onomatopoeic origin.\n",null,"\nFrom Proto-Finnic *koori (compare Estonian koor, Livonian ko, Veps kor'), from Proto-Uralic *kare (compare Moksha  (kar, bast shoe)). Possibly related to Proto-Indo-European *(s)ker-.\n\n",null,null,"\nFrom Proto-Finnic *kuuci, from Proto-Finno-Ugric *kutte. Cognates include Estonian kuus, Khanty  (xt), Mansi  (ht), Hungarian hat.\n\n","kuva + -io. Coined by Finnish physician and translator Wolmar Schildt.\n","From Proto-Finnic *knci, from Proto-Uralic *kne. Cognates include Estonian ks, Ter Sami kannc.\n",null,null,null,null,null,null,null,"From Proto-Finnic *maa, from Proto-Uralic *mxe. Cognates include Estonian maa and Karelian mua, Erzya  (mastor) (initial component), Komi-Zyrian  (mu), Udmurt  (mu), Mansi  (m).\n",null,"mt + -t",null,null,null,null,"nos- + -taa. Irregular; *noustaa would be expected.\n",null,"From Proto-Finnic [Term?], from Proto-Finno-Permic *oa-. Akin to Estonian ootama, Karelian vuottua, Livonian vdl, Ludian vuotada, Votic oottaa, Erzya  (utoms) and Eastern Mari  (vua).\n",null,"From ope- + -ttaa, from the same root as oppia.\n","From Proto-Finnic *p, from Proto-Finno-Ugric *pe. Cognates include Estonian pea, Veps p and Hungarian fej, f.\n",null,null,null,null,null,null,null,null,null,null,"Momentary aspect of puhua, from puh + -altaa, or earlier. Compare puhkua.\n",null,null,null,null,"sily + -tt",null,null,"sytty + -tt",null,"A causative verb, derived from the verb taipua; taipua + -ttaa. First adopted to mean \"to inflect, declinate, conjugate\" by Finnish clergyman and teacher H. K. Corander, in which sense a semantic loan from  Latin nflect.\n",null,"From Proto-Finnic *tektk, from Proto-Finno-Ugric *teke-. Cognates include Estonian tegema, Northern Sami dahkat, and Hungarian tesz.\n","From Proto-Finnic *terb. Equivalent to ter + -v (adjective-forming suffix).\n","From Proto-Finnic *toinen. Equivalent to tuo (that) + -inen.\n",null,"From Proto-Finnic *tuldak, from Proto-Uralic *tole-. Cognate with Hungarian tall.\n",null,"From Proto-Finnic *uni, from Proto-Finno-Permic *une.\n",null,null,null,"valmis + -taa",null,null,null,"From Proto-Finnic *vilja, borrowed from Proto-Indo-European [Term?] (cognate with Russian  (obilije, abundance)) and Czech obil (grain, cereals), if not directly from Slavic or Balto-Slavic. Other cognates include Estonian vili, Veps vil'l' and Proto-Samic *vlj.\n","yhd- + -ist",null,"From the conjugated forms of Old French amer, from Latin amre, present active infinitive of am (I love).\n","A suppletive verb; Latin vd (I go) supplies the present tense and re, present active infinitive of the synonymous e, supplies the future and conditional.\nThe all- forms derive from Middle French aller, from Old French aler (with subjunctive aill- and other forms with all-), from Vulgar Latin *al (attested in the 7th century Reichenau Glosses). \nMany explanations have been proposed for the etymology of this all- stem but none has met with a unanimous agreement among philologists. The all- stem has traditionaly been explained as deriving from Latin ambulre via or together with ambler (compare Old Occitan amblar, Italian ambiare, Romanian umbla), but this explanation is phonologically problematic; ambler is additionally more likely a borrowing from Old Occitan. Several theories have been put forth since the 17th century to explain how ambulare could have become aller.\nSince at least the 18th century, some have suggested that aller derives not from Latin but from Celtic, Gaulish *aliu, from Proto-Celtic zero grade *al-. Compare Welsh elwyf (I may go), Cornish ellev (I may go), from full grade *el- (see mynd for more). This theory is however phonetically problematic.\nAnother theory was proposed in 1934 by E.F. Parker, suggesting that aller derives from a Late Latin stem *allare which would have been formed out of allatum, past participle of adfero (\"to bring\"). The idiomatic phrase allatum esse (\"to be brought\") is recorded in Classical Latin and would have become very common in Northern France with a meaning derivation from being brought to to have been to, in which the past participle *allatus would have been taken as meaning to go and would have then inspired a new infinitive allare (allatus wouldn't have been felt any more as being the same verb as adferre due to particular dissemblance between its stems). This new stem allare would have then been used in suppletion for the Gallo-Roman verb to go as it's infinitive ire had already been forgotten (though it had already formed the future and conditional stem of this verb) and the monosyllabic forms of the present indicative conjugation had already been replaced with those of vadere.\nFranco-Provenal allar and Friulan l (to go) (compare lin (we go), lt (gone)) are from the same source, whatever it may be.\n",null,null,null,null,"From Old French bord, from Frankish *bord.\n",null,"From Middle French brusler to burn from Old French brusler, bruller (to burn), a conflation of bruir (to burn) (from Frankish *brjan (to burn, scald), from Proto-Germanic *bran to scald, from Proto-Indo-European *berw-, *brew- to boil, seethe), and usler (to scorch), from Latin ustulre (to scorch). \nCompare also Italian bruciare, from a Vulgar Latin form *brusi, which is probably related, as well as brustolare. The initial br- has had other origins proposed, such as from a Gaulish source, or from a corruption of a form *combustulre, from a change of prefix of ambustulre, influenced by combustus. Akin to German brhen (to scald), Dutch broeien (to heat). More at broil, brew.\n",null,null,"From Old French coper, colper (to cut off), probably, derived from cop (blow), colp (modern coup), with its meaning coming from the idea of cutting off with a blow. It may correspond to a Vulgar Latin verb *colpre, syncopated form of *colaphre, from Latin colaphus (compare Old Spanish golpar, colpar, Old Portuguese golpar, golbar). Alternatively, possibly from Vulgar Latin *cuppre (to behead), from Latin caput (head), although this is unlikely.\n",null,null,"en- + suite.\n","From Middle French entendre and Old French entendre, from Latin intendere, present active infinitive of intend (to turn one's attention, to strain).\n","(daughter): From Middle French fille, from Old French fille, from Latin flia.\n(slang, prostitute): By ellipsis of the euphemisms fille des rues (girl of the streets), fille de joie (girl of joy), fille publique (public girl), and others like them that signify \"prostitute\".\n","From Middle French, Old French guarder, from Frankish *wardon, from Proto-Germanic *ward-, corresponding to garde + -er. Compare Italian guardare, Spanish guardar, English guard, ward.\n","From Middle French genner, from Old French gehisner, derivative of gehine (torture resulting from confession, embarrassment), of Frankish origin. Synchronically analysable as gne + -er.\n",null,"From Middle French mettre, from Old French metre, from Latin mittere, present active infinitive of mitt, probably from Proto-Indo-European *meyth-, *mith- (to exchange, remove).\n","From Old French, from Vulgar Latin *ungla, syncopated form of Latin ungula, from unguis, ultimately from Proto-Indo-European *hneg-.\n",null,null,null,null,"From Middle French, from Old French reguarder, corresponding to French re- + garder.\n",null,"From Middle French lever, from Old French lever, from Latin levre, present active infinitive of lev (to elevate), from levis (light, not heavy)",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Cognate with Oroqen dr.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Cognate with Evenki  (mwan) and Oroqen man.\n",null,null,"Borrowed from Mongolian  (medee), ultimately from Proto-Mongolic *mede-, compare Manchu  (medege).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)","From Old Irish barr (top, tip, end; crop, produce), from Proto-Celtic *barros (compare Middle Welsh barr), ultimately from Proto-Indo-European *bers-.\n",null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,"From Old Irish caithid; compare Gaulish cateia (projectile).\n",null,null,null,"From Old Irish cene; cognate with Welsh gynneu.\n",null,null,null,null,null,null,null,"From Old Irish cruinnigid (to collect, gather, assemble, verb); surface analysis cruinn (gathered, adjective) + -igh (verbal suffix).\n",null,null,null,null,null,null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,null,null,null,"Possibly a borrowing from Middle English male or Anglo-Norman male, both meaning bag, from which the English mail and French malle are derived.\n","From Old Irish mit, mt (greatness, magnitude, of size, quantity, number, extent, degree).\n",null,"Borrowed from Middle English picken, from Proto-Germanic *pikn.\n",null,null,"From Old Irish reithid (verb) and riuth (noun), from Proto-Celtic *reteti (verb) and *retus (noun) (compare Middle Welsh redec), from Proto-Indo-European *Hret-.\n","From Middle Irish sithid, sidid, from Old Irish sidid (thrust, fix).\n","(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)\nCompare salach (dirty).\n",null,null,"From earlier seasamh, seasaigh, seasmhaigh, denominative from the verbal noun seasamh, from Old Irish sessam, verbal noun of sissidir, from Proto-Celtic *sista-, from Proto-Indo-European *ststehti, reduplicated present of *steh-.\n",null,null,null,"From Middle Irish suidid, from Old Irish saidid, from Proto-Celtic *sedeti, from Proto-Indo-European *sed-",null,"From Old Irish doicc. The imperative is from a related verb, doairicc.\n",null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,"Back-formation from tgil, from Middle Irish tcbil, verbal noun of dofcaib (lifts up, raises).\n",null,null,null,"Comparable to Phoenician  (dm, man, earthling), Ugaritic  (dm, man; red earth, red ochre), Old South Arabian  (vassals, subjects), Ge'ez  (dom, slave), Akkadian  (a-da-am-mu /adamu/, blood), Akkadian  (a-da-ma-tum /adamtu/, dark red earth or dye), Akkadian  (a-da-mu /adamu/, a red garment), Akkadian  (a-da-mu /adamu/, an important or noble person). The meaning range points to these words being extensions from Proto-Semitic *dam- (blood), compare the Palestinian Aramaic forms of it  /  /  (em, blood). The meaning development could be any of\nblood  red earth, red ochre  earthling or\nblood  man, as blood is a main ingredient of humans or\nblood  red earth, red ochre  the dye to paint idols  hence an idol  an effigy, a likeness  a man or\nblood  blood sacrifice to appease an idol  hence an idol  an effigy, a likeness  a man,\ncompare Arabic  (dumya, statue, idol; effigy, likeness; doll, puppet),  (damma, to bedaub).\n","Compare Ugaritic  (hb).\n","From Proto-Semitic *aad-. Compare  Arabic  (aad).\n","From the root  ('-kh-z) in the pa'l conjugation. From Proto-Semitic *aa-. Cognate with Arabic  (aaa), Aramaic , Maltese a.\n","From  (akhr, after) +  (kakh, such, thus).\n","From Proto-Semitic * (man, person). Compare cognates in other Semitic languages (e.g. Moabite, Aramaic, etc.) ('m in some).\n","From Proto-Semitic *akal-. Compare Aramaic  (al), Arabic  (akala).\n",null,null,null,"From Proto-Semitic *iba-. Compare Arabic  (iba), Aramaic  (eb), Classical Syriac  (e), Tigrinya  (aab), Coptic  (tb), Ugaritic  (b), Egyptian b.\n",null,null,"From Proto-Semitic *an-at-. Cognate with Ugaritic  (t), Aramaic  (int),  (itt), Arabic  (un).\n","Related to Phoenician  (yt), Punic  (t), and Aramaic .\n",null,null,"Compare Arabic  (baqara, cow)","From  (b'-, in) +  (shel, of).\n","From Proto-Semitic *gabr-, compare Aramaic  (gar, man), Ge'ez  (gbr, servant).\n",null,null,"Related to Ugaritic  (dg), of unknown ultimate origin.\n","Compare Aramaic  (dra, to tread), Arabic  (adraka, to reach, to overtake).\n","From the root  (b-v-').\n",null,null,null,null,null,null,"Related to Aramaic  (d) and Arabic  (). Compare also the definite form  (haze) and Arabic  (h).\n",null,null,"From Aramaic  above, which is cognate with Hebrew  (ed, one).\n","Related to Arabic  (ad) and Amharic  (ddis).\n",null,"From Proto-Semitic *alb-.\n",null,"Compare Arabic  (amm, hot), Eblaite  (-mu-tum /amm/, hot).\n","From the root  (-sh-b). Compare Arabic  (asaba, to reckon, compute), Egyptian sb (to calculate, to count).\n",null,"Compare Arabic  (walad, child),  (walada, to give birth), Ge'ez  (wld, child). \nAlso compare Proto-Indo-European *elt- (womb) and its derivatives.\n","From Proto-Semitic *waqar- (to be heavy or weighty; a tree laden with fruits; to be honorable or to hold weight in value), from Proto-Afroasiatic *waqar-; compare Egyptian jqr (excellent, worthy) and Arabic  (waqr, dignity, sobriety).\n",null,"Compare Aramaic / (k), Arabic  (kaiba, to be depressed, to be sad).\n",null,null,"From the root  (k-s-h).\n","Compare Akkadian  (kaspum).\n","From the root  (l-m-d), in the pa`l conjugation.\n",null,null,"From Proto-Semitic *lin-.\n",null,"From Aramaic  (mut, to totter, stagger)",null,"Compare Ge'ez  (ml, to fill, to be full).\n","Compare Arabic  (manaa).\n",null,null,null,null,null,"Compare Classical Syriac  (nan, to give). Possibly cognate with Arabic  (natana, to give off a foul smell, to stink), which may have undergone semantic narrowing.\n",null,"Compare Aramaic  (sipr, book).\n",null,null,"From Proto-Semitic *azab-. Cognate with Arabic  (azaba, to be remote or absent), Akkadian  (TAG4 /ezbu/, to leave)","From Proto-Semitic *all-, *aly- (high; height, elevation), from Proto-Afroasiatic *al-, *Vl(ay)- (to be high, tall; to rise; mountain).\nRelated to Arabic  (aliyy, to be high, exalted) and Arabic  (ulan, to climb).\n",null,"From Proto-Semitic *n (smoke)","Compare with Egyptian pj (this).\n","Compare Aramaic  (pn, to face).\n","Compare Arabic  (abaa, to dye), Aramaic  (ba, to dip, to dye), Akkadian  (/ab/, to soak, to bathe), Ge'ez  (b, to dip).\n",null,null,null,null,null,null,"From the root  (q-r-), forming words relating to the concept of tearing apart.\n","From the root .\n",null,"From Proto-Semitic *ra-. Cognate with Arabic  (ras).\n","From Proto-Semitic *rigl-. Compare Aramaic  (ril), Arabic  (rijl, foot, leg).\n","From Proto-Semitic *r- (to blow, breathe; spirit). Cognate with Aramaic / (r), Arabic  (r).\n",null,"Related to Arabic  (raiba, to desire).\n",null,null,null,"From the root  (--_).\n","From Proto-Semitic *alm-.\n","From Proto-Semitic *im-, from Proto-Afroasiatic *sim- (name). Cognate with Arabic  (ism, name).\n","From Proto-Semitic *amn-.\n",null,"From Proto-Semitic *an-. Cognate with Arabic  (sana).\n",null,null,"From the root  (t-p-s).\n",null,null,null,null,null,"Inherited from Sanskrit  (kalya).\n",null,null,null,null,null," (garam) + - (-).\n",null,null,"Inherited from Sauraseni Prakrit  (ghara), from a metathesized form of Sanskrit  (gh). Doublet of  (gh).\n",null,"Cognate with Nepali  (cahnu).\n",null,null,null,"From  (chon, to leave) or  (chorn, to free).\n",null,null,null,null,"From Proto-Indo-Aryan [Term?].\n","Compare Punjabi  (hakka), Assamese  (dhoka). Related to  (hakkan, cap, cover, lid).\n","Borrowed from Persian  (taxte).\n",null,null,null,null,null,null,null,"Borrowed from Persian  (nxon). Compare with Sanskrit  (nakh).\n",null,null,"Borrowed from Persian  (panje).\n",null,"From the oblique masculine form of  (pahl, first).\n",null,null,null,null,"From  (pe, stomach). Mumbai sense borrowed from Marathi  (pe, chest, box).\n",null,null,"From earlier  (bjn), from Sanskrit  (vdyate). Compare Nepali  (bajnu), Gujarati  (vgv), Marathi  (vje), Assamese  (boza).\n",null,"From  (bt, talking, discussion).\n"," (badal) + - (-n). The first element in the word is from Arabic.\n",null,"Regular causative form of  (bann). Compare Marathi  (banave).\n",null,null,"Inherited from Ashokan Prakrit * (*boll, to speak, utter); related to  (boln, to speak).\n",null,"Inherited from Sauraseni Prakrit  (bolladi), from Ashokan Prakrit * (*boll, to speak, utter). Compare Bengali  (bla), Assamese  (bla), Marathi  (bole), Punjabi  (bol). Also compare  (buln, to call).\nPerhaps further from Sanskrit * (bryate), a metathesized form of  (bryate), from the root  (br, speak, say).","From Ashokan Prakrit * (*bhaggati), a verbal derivation from Sanskrit  (bhagna, broken, defeated, lost), from the root  (bhaj). Cognate with Nepali  (bhgnu), Gujarati  (bhgv), as well as Punjabi  (bhajja) from a different derivation.\n",null,null,"Inherited from Sauraseni Prakrit  (miladi), from Sanskrit  (milati). Cognate to Punjabi  (mil), Nepali  (milnu), Gujarati  (mav), Assamese  (mila),\nSylheti  (mila), Bengali  (mia), and Marathi  (mie).\n",null,null,null,null,null,"Cognate with Nepali  (roknu).\n","Inherited from Sanskrit  (aati). Cognate with Punjabi  (san) /  (san), Gujarati  (sav), Marathi  (sae), Sindhi  / , Assamese  (xora).\n","Learned borrowing from Sanskrit  (samcra, proceeding, conduct, news, information).\n","Borrowed from Sanskrit  (sundara).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"az (that) + -kor (time, at the time of)","From Proto-Finno-Ugric *ol (chin, jaw-bone).",null,null,null,"Of unknown origin.","Borrowed from a Slavic language, from Proto-Slavic *initi.","Of uncertain origin, perhaps from Proto-Finno-Ugric *ua (point, peak).","Borrowing from an Oghur language, before the times of the Hungarian conquest of the Carpathian Basin (at the turn of the 9th and 10th centuries), from Proto-Turkic *d (noon). Compare Tuvan  (d, noon), dialectal Turkish d (noon).\n","Borrowed from a Slavic language, perhaps from Serbo-Croatian. Compare Serbo-Croatian dug (debt), Slovak dlh (debt).","Borrowed from a South Slavic or a West Slavic language. Compare Serbo-Croatian, Slovene drag; Czech, Slovak drah; Polish drogi (expensive, dear), from Proto-Slavic *dorg. Hungarian most likely borrowed the feminine form of the Slavic adjective.","Probably from Proto-Finno-Ugric *se (air). Possible cognates are limited to Baltic-Finnic (e.g. Finnish s (weather)) and Komi-Permyak  (synd, warm air).","egyszer + -re",null,"el- + rejt","el- + tr","From a Turkic language before the times of the Hungarian conquest of the Carpathian Basin at the turn of the 9th and 10th centuries.","From Proto-Uralic *e- (to fall) + -ik.",null,null,null,null,null,"[after 1372] Of uncertain origin. Perhaps from Proto-Finno-Ugric *p- (color; to color, paint) + -t (causative suffix).","From the original stem fi akin to Proto-Uralic *pojka (son, boy) + - (archaic diminutive suffix). Cognates include Mansi  (pyg, son, boy), Udmurt  (pi, son, boy), Komi-Zyrian  (pi, son, boy) and Finnish poika. See also faj. Unrelated to Romanian fiu.\n","(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,"Of uncertain origin, perhaps a derivation. One explanation is that it is from fl (the upper part of something) + -d (nominal suffix, originally diminutive suffix). For similar derivation, compare gyenge (weak) > gyengd (gentle).","[after 1372] Of uncertain origin. Perhaps from Proto-Uralic *prke- (*pr-) (to turn, revolve, spin) + -dt (causative suffix).","From a stem of unknown origin + -jt (causative suffix).","From Proto-Ugric *kaj- (to bend, stoop) + -t (causative suffix).","From Proto-Uralic *kala. Cognates include Khanty and Mansi  (hul), Finnish and Estonian kala.","From the coincidence of the Proto-Uralic *kontale- (compare Old Hungarian hadl (hear), Mansi  (hntli), Finnish kuunnella) and Proto-Uralic *kule- (compare Mansi  (hlukve) and Finnish kuulla).\n","From an unattested stem with the suffix -g.\n","Of unknown origin.","From Proto-Ugric *spt (seven), borrowed from an Indo-European language (Proto-Indo-European *sept); compare Sanskrit  (saptn), Ancient Greek  (hept). Initial h- is by analogy with hat (six). Compare Mansi  (st, seven).\n","Native development. Probably from a stem of unknown origin + -d (frequentative suffix) + -eg (nominal-forming suffix). For the ending, compare beteg (ill), meleg (warm).","Of uncertain origin. Perhaps from Proto-Uralic *kae- (to call).",null,"Probably borrowed from a Chuvash-type Turkic language before the times of the Hungarian conquest of the Carpathian Basin (at the turn of the 9th and 10th centuries), ultimately from Proto-Turkic *d (time) and cognates with Karakhanid  (, time), Southern Altai  (y, time), Turkish le (noon).\n","(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)","From Proto-Finno-Ugric *jor (roll).\n","Probably an onomatopoeia.","From Proto-Uralic *kne (fingernail, toenail) + -m (nominal suffix).",null,"From a stem of unknown origin + -ik.","Possibly from Proto-Uralic *luwe (bone) + the suffix -b, used in an unusual diminutive function. Compare Northern Mansi  (lu) and Finnish luu.\nAlternately, from Proto-Uralic *lmpe (blade, flat part, width (of hand or foot)), akin to Selkup [script needed] (laamp).\n","A variant form of leny.",null,"Of uncertain origin. Either derived from the same supposed stem as lebeg (to float); or from Proto-Ugric or perhaps Proto-Finno-Ugric *lp, *lep (leaf). The meaning letter is attested from the 14th century onwards.",null,"meg- + gyjt","meg- + javt","meg- + kap","meg- + nz",null,null,"From Proto-Uralic *me.\n","Of unknown origin.",null,"From Proto-Uralic *ni (woman). Cognates include Mansi  (n, woman).","From the nv- stem of n (to grow) + -ekszik.\n","From Proto-Finno-Ugric *lm (tongue). Cognates include Mansi  (nlum, tongue) and Northern Sami njlbmi.\n",null,"From Proto-Finno-Ugric *sula (to molten, melted; melt, dissolve) + -ad (frequentative-instantaneous suffix). Cognates include Mansi  (tolukve) and Finnish sulaa.","Of uncertain origin. Either from a Chuvash-type Turkic language or derived from r.",null,null,"An onomatopoeia.",null,"From the old onomatopoeic verbal stem sar- + -ok (noun-forming suffix).","Perhaps from Proto-Finno-Ugric *ij- (to run) + -t (instantaneous verb-forming suffix).","Probably from Proto-Finno-Ugric *i-r (grave).",null,"From a stem of unknown origin + -ed (frequentative verb-forming suffix).","(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)","Of uncertain origin. Perhaps from Proto-Finno-Ugric *ent- (to tear down, rip, break off).",null,"From Proto-Uralic *ilm, then from szimi, via szm in one dialect (such as the one used in the Old Hungarian Lamentations of Mary), resulting in dialectal szm, as well as via szm and the current, standard szem from another dialect.","From the same stem as the noun szerelem (romantic love) + -et (momentane verb-forming suffix). The stem szer comes from the verbal application of Proto-Uralic *er (row, order) nounverb with the meaning to join; to be linked / related to each other.","From Proto-Uralic *tole- + -l (frequentative suffix). Cognates include Finnish tulla.","From Proto-Uralic *tuna- (to get used to, to learn) + -t (causative suffix).","From Proto-Finno-Ugric *teke-. Cognates include Finnish tehd and Estonian tegema.","From the same Proto-Uralic root *tumte- (to know) as Finnish tuntea and Estonian tundma.\n","From Proto-Uralic *suwa (finger). Cognates include Mansi  (tul).\n","Of unknown origin.","From East Proto-Uralic *ukt (trace) or *uxt (trace), Proto-Uralic *utka. Cognate with Tundra Nenets  (') or  (trace, way).","From Proto-Ugric *wake- (to strike, cut) or perhaps from Proto-Finno-Ugric *wa (to strike, cut).",null,"From Proto-Finno-Ugric *wnt- (to see, look at, watch).","Of uncertain origin, possibly from Proto-Finno-Ugric *wii (end). Cognate to Finnish viime and Estonian viimane.","From Proto-Finno-Ugric *wekk (thin) + -ny.","From earlier *vew- (compare vev buying, vett he bought), from Proto-Uralic *wexe- (to take). Often considered a doublet of visz (to carry), but this may not be correct.\n","From Proto-Finno-Ugric *wet- (to lead, to guide, to draw, to pull) + -t (causative suffix). Cognates include Finnish vet. The Finno-Ugric root may be related to Proto-Indo-European *wed-, either as loan or through genetic relationship.",null,"From the same onomatopoeic (sound-imitative) root as zdt (to pour) and zdul (to come pouring, rushing) + -g (frequentative suffix).","From Old Armenian  (ankiwn).\n","From Old Armenian  (axatank); see below.\n","From Old Armenian  (apa).\n","From Old Armenian  (aa).\n",null,"From Old Armenian  (apn).\n","From Old Armenian  (ban); see it for more. The main meaning of  (ban) in Old Armenian was \"word, speech, saying\". The sense \"thing\", which is the only one surviving in modern Armenian, developed from the notion of speech  the subject of speech  the subject itself. Typologically compare Hebrew  (davar, word, speech; thing).\n","From Old Armenian  (barjranam).\n","From Old Armenian  (barjracucanem).\n","From Old Armenian  (bnem).\n","From Old Armenian  (gic).\n","From Old Armenian  (gorc).\n","From Old Armenian  (dnem).\n","From Old Armenian  (erewel), infinitive of  (erewim); see it for more.\n",null,"From Old Armenian  (ntanal), infinitive of  (ntanam); see it for more.\n","From Old Armenian  (ankanim).\n","From Old Armenian  (tew).\n","From Old Armenian  (lezu).\n","From Old Armenian  (xabem).\n","From Old Armenian  (xelk); see below.\n","From Old Armenian  (xot).\n","From Old Armenian  (cackem).\n"," (cov) +  (ap)","From Old Armenian  (kangnem).\n","From Old Armenian  (keew).\n","From Old Armenian  (kendani).\n","From Old Armenian  (kerakur); see it for more.\n","From Middle Armenian  (ktor), from Old Armenian  (kotor). Doublet of  (kotor).\n","From Old Armenian  (yetoy)","Learned borrowing from Old Armenian  (hosim).\n","From Old Armenian  (ekavarem).\n","Learned borrowing from Old Armenian  (ahi).\n","From Old Armenian  (iw).\n",null,"From Old Armenian  (mard).\n","From Old Armenian  (mart).\n","From Old Armenian  (mtanem).\n","From Old Armenian  (nstel), infinitive of  (nstim); see it for more.\n","From Old Armenian  (abat).\n","From Old Armenian  (patpanem).\n","From Old Armenian  (patker).\n",null,"From Old Armenian  (sp omplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,null,null,null,null,null,null,"Borrowed from Sanskrit  (drgha, long).\n",null,null,null,null,null,null,null,null,null,"Borrowed from Sanskrit  (bala).\n",null,null,null,"Borrowed from Sanskrit  (bhmi).\n",null,null,"Cognate with Tamil  (mu), Telugu  (ma).\n",null,null,null,null,null,null,null,null,null,"Borrowed from Sanskrit  (hima).\n",null,null,null,null,null,null,null,null,null,null,null,null,"From Old Georgian  (day), from Proto-Kartvelian *da-. Cognate with Mingrelian  (da), Laz  (da) and Svan  (day),  (dauir),  (udil). Svan  (day) might be borrowed from Georgian rather than inherited from Proto-Kartvelian.\n",null,null,null,null,null,"From Old Georgian  (enay), from Proto-Kartvelian *nen-. Cognate with Svan  (nin), Mingrelian  (nina) and Laz  (nena).\n",null,null,null,"From Old Georgian  (wiray),  (wiria), from Koine Greek  (Kuriak, Sunday).\n",null,null,null,null,null,null,null,null,"From Old Georgian  (sakm),  (sakmey), most probably from  (ikms).\n","From Old Georgian  (siquay), from Proto-Georgian-Zan *qw-. Cognate with Mingrelian  (ziqva).\n",null,"From Hittite [script needed] (uppi, clean). Most likely a Proto-Kartvelian borrowing during the late, Proto-Karto-Zan stage of development (XIX-VIII centuries BC).(Can this(+) etymology be sourced?)On the other hand, according to Aaean, borrowed from Iranian from a word in the family of Persian  (safid, white).\n",null,"Related to Old Armenian  (taax, mortar), Laz  (olopi, mud).\n","From Old Georgian  (ani), probably borrowed from Persian  (tan, body). Compare Old Georgian  (vaxang).\n","From Old Georgian  (qavi), from Proto-Georgian-Zan *qaw-. Cognate with Mingrelian  (qebi), Laz  (ebi),  (ebi).\n",null,null,"From Old Georgian [Term?], from Proto-Kartvelian *prcx- (fingernail; to scratch).\n",null,"From Old Georgian  (qeli), from Proto-Kartvelian *qel-. Cognate with Mingrelian  (qali),  (ali) and Laz  (qali),  (ali). The word is also preserved in Svan m-ql-a (m-ql-a).",null,null,null,null,null,null,null,null,null,"From Old Georgian  (xe); see below for more.\n","From Old Georgian  (qmay), from Proto-Georgian-Zan *qam-, *qm-. Cognate with Mingrelian  (xuma). For the political sense, compare Russian  (golos).\n",null,"From Proto-Turkic *ga.\n","From Proto-Turkic *(k) (moon, month). Cognate with Azerbaijani ay, Turkish, Crimean Tatar ay, Tatar, Bashkir, Kyrgyz  (ay), Southern Altai  (ay), Uzbek oy, etc.\n",null,"Cognate to Azerbaijani alov and Turkish alev.\n",null,null,null,null,null,null,null,"From Proto-Turkic *agr-g (pain, illness), an action noun of *agr- (to ache; be ill).\nCognate with\nKarakhanid  (ar, pain),\nOld Uyghur qryq (ar, pain, illness), Kyrgyz  (ooru), Southern Altai  (ooru),\nUzbek ogriq (pain, ilness),\nUyghur  (aghriq, illness),\nKhakas  (ar, illness; ill),\nTuvan  (aarg, illness, pain),\nYakut  (ar, pain, disease),\nTurkish ar (pain, ache), etc.\n","From Proto-Turkic *adak (foot, end).\n","Borrowed from Persian  (hangme). Cognate with Bashkir  (gm), Kyrgyz  (ageme), Uzbek hangama (id.), etc.\n",null,null,null,null,"From Proto-Turkic *bar- (to walk, go; to come, reach). Cognate with Turkish varmak.\n","From Common Kypchak bawr, from Proto-Turkic *biagr (liver). Cognate with Old Uyghur baarsuq (intestines, viscera), Turkish barsak (intestine), etc.\n",null,null,null,null,"Cognate with Tatar  (taw),\nBashkir  (taw),\nKarakalpak  (daws),\nKarachay-Balkar  (tauu),\nKyrgyz  (too),\nUzbek tovush,\nUyghur  (tawush),\nCrimean Tatar davu,\nKhakas  (tabs, voice, sound).\n","From Proto-Turkic *de- (to say). Cognate with Azerbaijani demk, Turkish demek.\n","Cognate with Azerbaijani eitmk, Uzbek eshitmoq.\n",null,"Ultimately from Proto-Turkic *y- (to write). Cognate with Azerbaijani yazmaq, Uzbek yozmoq, etc.\n",null,null,"From Proto-Turkic *ya, *yei (new).\n",null,null,null,null,null,null,null,null,null,null,null,null,"Cognate with Azerbaijani glmk, Uzbek kulmoq.\n","From Proto-Turkic *gn (sun, day).\n",null,null,null,"From Common Turkic *ka- (to run away, flee).\n",null,"From Proto-Turkic *Kol.\n",null,null,"From Proto-Turkic *ok-.\n",null,null,"From Proto-Turkic *ol-tur- (to sit).\n","Cognate with Azerbaijani oyanmaq, Uzbek uygonmoq.\n","Cognate with Azerbaijani lmk, Uzbek olmoq.\n",null,"From Proto-Turkic *sia (swamp, marsh).\nCognate with\nBashkir  (ha), Kyrgyz, Tatar  (saz),\nUzbek soz,\nSouthern Altai, Khakas  (sas, swamp, marsh);\nChuvash  (ur, swamp, marsh),\netc.\n","From Proto-Turkic *sk (aware, alert).\n",null,null,"From Proto-Turkic *sl (left).\n",null,"From Proto-Turkic *s.\n",null,"From Common Kipchak *sy-, from Proto-Turkic *seb- (to love). Cognate with Turkish sev-, etc.\n",null,null,null,null,"Ultimately from Proto-Turkic *dart- (to pull; to hang). Cognate with Azerbaijani dartmaq.\n",null,null,"From Proto-Turkic *dil (tongue; language).\nCognate with\nTatar  (tel),\nBashkir  (tel),\nKyrgyz  (til),\nUzbek til,\nTurkish dil (tongue, language).\n",null,null,"From a Mongolic source, from Proto-Mongolic *tle- (to pay).\nCognate with\nOld Uyghur [script needed] (tl-, to pay);\nBashkir  (tlw), Kyrgyz  (tl), Uzbek tolamoq, Uyghur  (tlimek),\nKhakas - (tle-), Tuvan  (tleer, to pay).\n",null,"From Proto-Turkic *dur- (to stand). Cognate with Turkish durmak, Turkmen durmak, Crimean Tatar turmak, Uzbek turmoq, Uyghur  (turmaq), Azerbaijani durmaq, Tatar turu, Chuvash  (tr), etc.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,nu
