Proto-Mongolic *bos-, compare Dongxiang bosi.\n","From Proto-Mongolic *budaxan, perhaps related to Proto-Turkic *botka (gruel).\nCompare Dongxiang budan, Bashkir  (butqa), Chuvash  (pt).\n",null,null,null,"From Proto-Mongolic *gar, commonly connected with Proto-Turkic *kar, *kar (forearm) or Proto-Tungusic *gara (branch, bough).\nCompare Dongxiang kha, Daur gary, Kazakh  (qar), Tuvan  (kr, ulna), Evenki  (gara), Manchu  (gargan).\n",null,"Compare Buryat  (ger), Kalmyk  (ger).\n",null,null,null,null,"From Proto-Mongolic *daxula-, compare Dongxiang daola.\nEquivalent to  (duu, song, voice) + - (-lah).\n",null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)","See Chinese  (zhn, (post) station).\n","From Proto-Mongolic *jasa-, compare Mongghul sza (make, repair).\nTurkic forms of the word (see Turkish yasamak) are considered Mongolisms, relation with Manchu  (dasambi, to govern), if any, is unclear.\n",null,"Attested once in a 1338 Middle Mongolian document as  (osuulbasu, (if he) let (them) stop), but otherwise restricted to modern Central Mongolic.\nCognate with Buryat  (zogsoxo), Kalmyk  (zogsx).\nReplaced Proto-Mongolic *ba- in the sense 'to stand', see  (bajh, to be).\n","Proto-Mongolic *jaxu-, compare Dongxiang zhao.\n",null,null,"From Classical Mongolian  (modu), from Middle Mongolian [Term?], Proto-Mongolic *modu. Cognate with Buryat - (modo-), Kalmyk - (mod-), Dongxiang mutun, etc.\n","From Proto-Mongolic *megn, compare Dongxiang miengu.\nPerhaps related to Western Yugur menek (money), Arghu  (benek, small copper coin) identified by Clauson with Common Turkic *benek (spot, speck, freckle) from Persian  (banak, seed, pimple)  (perhaps influenced by *be (birthmark)). See Turkish benek.\n","From Proto-Mongolic *mre (shoulder), perhaps related further with Proto-Tungusic *muire.\nCompare Daur mur, Evenki  (mir), Nanai .\n",null,"Inherited from Proto-Mongolic *narn, compare Dongxiang narun, Daur naring.\n",null,"From Proto-Mongolic *nkr, compare Dongxiang nokie.\n",null,null,"From Proto-Mongolic *nigen, *niken.\n",null,null,null,"From Proto-Mongolic *kin (daughter). Compare Buryat  (xin) and Dongxiang ojin.\n","From Proto-Mongolic *ebed-, compare Mogholi ebetku.\n","From Proto-Mongolic *ebesn, compare Dongxiang osun.\n","From Proto-Mongolic *g-. Cognate to Dongxiang ogi and perhaps Khitan [Khitan Small needed] ().\n",null,null,null,null,null,"From Proto-Mongolic *sabar, compare Mongghul sawar.\n",null,"From Proto-Mongolic *sara more distantly related to Khitan  (sair)",null,"From Proto-Mongolic *saxu-, compare Dongxiang sao, Daur saugw.\n","Ultimately from Proto-Turkic *srg (flock, herd), equivalent to *sr- (to drive) + *-g. Compare Turkish sr.\n","From Proto-Mongolic *talb- (to free), compare Daur taly-.\nThe evolution of senses from to release > to place is shared with Chinese  (fng).\n",null,"From Proto-Mongolic *toguxan, compare Dongxiang tughon.\n",null,null,"From Proto-Mongolic *tle-, compare East Yugur tl.\n","From Proto-Mongolic *tex-, compare Dongxiang qiao.\n",null,"From Proto-Mongolic *tegeri, from Proto-Turkic *teri, compare Old Turkic  (teri, sky).\n","From Classical Mongolian  (ter-e, that), from Middle Mongolian  (tere) and  (ter-e, that), from Proto-Mongolic *tere (that). Cognate with Buryat  (tere, that), Kalmyk  (ter, that; he, she, it), Dongxiang tere, etc.\nReplaced original  (i, compare Daur ing) for sense he, she, it as the third-person singular pronoun.\n","From Classical Mongolian  (ulus), from Middle Mongolian  (ulus), from Common Turkic *ulu (country; city). Compare Buryat  (ulas), Kalmyk  (uls); Old Uyghur 'wlw (ulu, country); etc.\n",null,"From Proto-Mongolic *urtu, compare East Yugur hurtu, Daur ort.\n","From Proto-Mongolic *hjxr, compare Dongxiang uzhu, Daur xujuur.\n","From Proto-Mongolic *nen, compare Daur unung.\n",null," (haah, to close, to block) + - (-lga)",null,null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,"Cognate with Buryat  (xajaxa) and Kalmyk  (xayx). Not found outside Central Mongolic.\n",null,null,"From Proto-Mongolic *koxala (throat).\n","From Proto-Mongolic *kdel-, compare Mongghul ghudili, Dongxiang gojielu.\n","From Proto-Mongolic *kl, perhaps related with Proto-Turkic *kol (arm).\nCompare Dongxiang kon, Turkish kol.\n","from Proto-Mongolic, borrowed or cognate with Proto-Turkic *kk, compare with Turkish gk and Evenki  (kuku, sea-coloured).\n","From Proto-Mongolic *kmusun, compare Dongxiang ghimusun (nail, hoof).\n","From Proto-Mongolic *kuruxun, compare Dongxiang ghurun.\n","From Proto-Mongolic *kjxn, compare Dongxiang ghuzhun, Daur xujuu.\n",null,null,"Cognate with Buryat  (xljeexe), Kalmyk  (klx).\n","From Proto-Mongolic *krje(g), from Proto-Turkic *kre-ek.\nCompare Mangghuer kuerji, Turkish krek.\n","From Proto-Mongolic *kw.\n","From Proto-Mongolic *kelen, compare Dongxiang kielien.\n",null,"From *kele-, a haplological variant of Proto-Mongolic *kelele-, equivalent to  (hel, tongue, language) + - (-leh).\nCompare Dongxiang kielie.\n","From Proto-Turkic *krk (necessity), from earlier *krgk. \nSome senses might be from * (*hereh) + - (-g), with unattested * (*hereh) being also the root of  (herl, quarrel) and  (hereldeh, to quarrel).\n",null,"From Proto-Mongolic *cagaxan, compare Dongxiang chighan.\n","From Proto-Mongolic *cok- (to peck), from Proto-Turkic *ok- (to swoop down on, to peck). Evolution of sense to more general to hit is shared with other Central Mongolic languages and Daur.\nCompare Dongxiang chughu, Kazakh  (oqw).\n","From Proto-Mongolic *cexeji, compare Mogholi caiji.\n","From Tibetan  (shel).\n",null,null,null," (ergeh, to turn) + - (-uulah)","From Proto-Mongolic *erexn, compare Daur eruu.\n",null," (eh, beginning, origin) + - (-lah)","(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)","From Proto-Iranian *tr-, from Proto-Indo-Iranian *tar-, from Proto-Indo-European *hehter- (fire). Compare Persian  (zar), Avestan  (tar, fire), Ossetian  (art), Pashto  (or); compare also Old Armenian  (ayrem), Serbo-Croatian vatra, Irish ith (kiln), Welsh odyn, Umbrian  (atru), and Latin ter, which may be derived from the same ultimate root.\n",null,"From Proto-Iranian [Term?] (compare Avestan  (vt), Pashto and Persian  (bd)), from Proto-Indo-Iranian [Term?] (compare Sanskrit  (vta)), from Proto-Indo-European *hwhnts (blowing), present participle of *hweh- (to blow).\n",null,null,"Borrowed from Arabic  (mismr).\n",null,"Related to Persian  (bdan).\n",null,null,"From Persian  (and).\n","Related to Persian  (arm).\n",null,null,"From Proto-Indo-European *kyew- (to move, go). Cognates include Persian  (odan, to become), Ossetian  (cwyn), Pashto  (wl), Sanskrit  (cyvate, move to and fro, stir), Old Armenian  (u) and Ancient Greek  (se, put in quick motion, drive).\n",null,null,null,null,null,null,"From Proto-Iranian *drHgh, from Proto-Indo-Iranian *drHgs, from Proto-Indo-European *dlhgs. Compare Persian  (dirz), Sanskrit  (drgha).\n",null,null,null,null,null,null,null,"Related to Persian  (goftan).\n",null,null,null,null,"From hev + -al. Cognate with Persian .\n",null,null,"From Proto-Iranian *Hah, from Proto-Indo-Iranian *Has.\n",null,null,null,"Cognate with Persian  (kanz)",null,"From Proto-Iranian *kar-, from Proto-Indo-European *ker-. Cognates include Bactrian - (kir-), Persian  (-gar).",null,null,null,null,null,null,null,null,null,"From *mrd, from Proto-Iranian *mrth, from Proto-Indo-Iranian *mrts, from Proto-Indo-European *mrts. Compare Persian  (mard).\n","Related to Persian  (magas).\n","From Proto-Iranian [Term?], from Proto-Indo-Iranian [Term?], from Proto-Indo-European *mer-.\n","From an earlier *nam, related to Persian  (nm).\n",null,null,null,null,null,null,null,null,null,"From Turkish kay.\n",null,null,"ra- + bn",null,null,null,null,"From Proto-Iranian [Term?], from Proto-Indo-Iranian [Term?], from Proto-Indo-European *wrhds (root). Cognate with English root, Latin radix, Greek  (rza).\n","From Proto-Iranian *rwah, from Proto-Indo-Iranian *rwas, from Proto-Indo-European *lwk-os ~ *lwk-es-os, from *lewk- (white, light, bright). Compare Persian  (ruz), Avestan  (raocant, shining),  (raocah, light), Sanskrit  (rocate, to shine).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"ve- + gotin","xap + -andin",null,null,null,null,null,null,null,null,null,"From Proto-Iranian *hiwH (compare Persian  (zavn)/ (zabn), Pashto  (ba), Avestan  (hizuu)), from Proto-Indo-Iranian *iwH (compare Sanskrit  (jihv), Hindi  (jbh)), from Proto-Indo-European *dnwhs (compare Old Prussian insuwis, Russian  (jazk), French langue, English tongue).\n",null,null,null,null,null,null,"A Permic word. Maybe related to the Finnic and Samic words meaning sun, compare Estonian pev, Finnish piv and Northern Sami beaivi.\n","From Proto-Finno-Ugric *per. Cognates include Estonian pra, Udmurt  (ber) and Hungarian far.\n",null,"From Proto-Permic *v, from Proto-Uralic *wete.\n",null,"A Permic word (*wia) like Udmurt  (vo). The Permic word, which is akin to Finnish vihre, seems to be from or akin to an Indo-Iranian word meaning poison.\n",null,"From Proto-Permic (compare Udmurt  (vordyny)), from Proto-Indo-Iranian *Hward-.\n",null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Uralic *kne.\n",null,null,null,"From Proto-Uralic *jm.\n",null,null,null,null,"An old compound. The second element is a Permic *kad, from Proto-Finno-Ugric *kota.\n","A Permic word, related to Udmurt  (karyny). Seems to be a borrowing from an Indo-Iranian language.\n",null,null,"From Proto-Finno-Ugric *ker-. Cognates include Hungarian kr.\n",null,null,"From Proto-Uralic *kle. Cognates include Udmurt  (kyl), Finnish kieli, Estonian keel and Northern Sami giella.\n","From Proto-Uralic *kule-.\n",null,null,null,null,null,"From Proto-Finno-Permic *lowna. Cognates include Udmurt  (nunal) and Finnish lounas.\n",null,null,null,null,null,"From Proto-Uralic *mxe.\n","From Proto-Uralic *mene-.\n",null,null,null,"From Proto-Uralic *el-.\n",null,null,null,null,null,null,"From Proto-Permic [Term?], cognate to Udmurt  (potyny).\n","From Proto-Uralic *pele-.\n",null,null,null,"From Proto-Uralic *puwe.\n",null,"From Proto-Permic [Term?], cognate to Udmurt  (pyryny).\n",null,null,null,"From Proto-Permic [Term?], cognate to Udmurt  (sjotyny).\n",null,"From Proto-Finno-Ugric *sula.\n",null,"From Proto-Permic [Term?], from Proto-Uralic *tuxli.\n",null,null,"From Proto-Finno-Permic *teje, compare Estonian tee and Finnish tie.\n","From Proto-Permic *turn, from Proto-Finno-Permic *tarna, borrowed from Indo-European, from Proto-Indo-European *trns. Cognate with Udmurt  (turyn), Finnish taarna.\n",null,null,null,"From Proto-Uralic *la.\n",null,"A Permic word like Udmurt  (u).\n",null,null,null,null,null,null,"First attested in the Yongbi eocheonga ( / ), 1447, as Middle Korean (Yale: kata).\n","First attested in the Sinjeonjachwi yeomchobang eonhae ( / ), 1635, as Early Modern Korean (Yale: kolaancta). From the now-lost root *kol- (\"to flow\"), whence also the obsolete words  (garam, river) and  (geol, ditch), and the verb  (anda, to sit).\n","First attested in the Seokbo sangjeol ( / ), 1447, as Middle Korean (Yale: kaci). From Old Korean  (*KAc).\n","First attested in the Seokbo sangjeol ( / ), 1447, as Middle Korean (Yale: keli).\nPerhaps related to Old Chinese  (OC *kre, *kre, street).\n","First attested in the Neung-eomgyeong eonhae ( / ), 1461, as Middle Korean (Yale: kwlhwy).\nCompare Japanese ,  (koru, to bind together with rope or twine); ,  (kori, a bale; something bound together with rope or twine);  (kuri, winding, reeling, rolling up, as onto a spool).\n",null,null,null,"First attested in the Worin seokbo ( / ), 1459, as Middle Korean (Yale: nwokta). Derived from a root meaning \"soft, tender, relaxed, slow\". Compare  (neugeuthada),  (nareunhada),  (neuseunhada).\n","First attested in the Jln lish ( / ), 1103, as  (MC nunH) equivalent to modern hanja reading  (nun).\nIn the Hangul script, first attested in the Seokbo sangjeol ( / ), 1447, as Middle Korean (Yale: nwn).\n",null,null,"First attested in the Yongbi eocheonga ( / ), 1447, as Middle Korean (Yale: ttt).\n",null,null,null,"First attested in the Yongbi eocheonga ( / ), 1447, as Middle Korean (Yale: ml-ht), equivalent to modern  (mal, word) +  (hada, to do, light verb).\n","From  (mok, neck) +  (sori, sound).\n","First attested in the Seokbo sangjeol ( / ), 1447, as Middle Korean (Yale: polata).\n","First attested in the Beonyeok sohak ( / ), 1517, as Middle Korean (Yale: polapwota).\n","First attested in the Yongbi eocheonga ( / ), 1447, as Middle Korean (Yale: pul).\nPossibly cognate with Old Japanese  (pi2) (< Proto-Japonic *poy).\n",null,null,"First attested in the Yongbi eocheonga ( / ), 1447, as Middle Korean (Yale: syeta).\n","Causative form of  (sokda, to be deceived).\n",null,"First attested in the Worin seokbo ( / ), 1459, as Middle Korean (Yale: swumkita). From  (sum-, to hide, intransitive) +  (gi-, causative suffix) +  (da, verb ending).\n","Of native Korean origin. From Middle Korean  (Yale: sis.ta),  (Yale: psis.ta).\n","First attested in the Hunmong jahoe ( / ), 1527, as Middle Korean (Yale: entek).\n","First attested in the Yongbi eocheonga ( / ), 1447, as Middle Korean (Yale: yelh).\n","First attested in the Seokbo sangjeol ( / ), 1447, as Middle Korean (Yale: wumcukta).\n",null,"From  (iyagi, story) and the Korean verb  (hada, to do).\n","First attested in the Yongbi eocheonga ( / ), 1447, as Middle Korean (Yale: capta).\n","Sino-Korean word from , from  (place) +  (place)",null,"First attested in the Yongbi eocheonga ( / ), 1447, as Middle Korean (Yale: cwuta).\n",null,"First attested in the Worin seokbo ( / ), 1459, as Middle Korean (Yale: pstiluta).. In the same work, also attested in the form of  (tilota).\n",null,"From  (, cheongso) +  (hada).\n","First attested in the Yongbi eocheonga ( / ), 1447, as Middle Korean (Yale: tht).\nThe Yanbian meaning to call (on the phone) is a semantic loan from  Chinese  (d, to hit; to call).\n","Of native Korean origin, from Middle Korean  (h-t), from Old Korean  (*HO(Y)-).\n",null,null,"First attested in the Seokbo sangjeol ( / ), 1447, as Middle Korean (Yale: huluta).\n","Of native Korean origin.\n",null,null,null,null,null,"From Proto-Permic *v, from Proto-Uralic *wete. Cognates include Hungarian vz and Finnish vesi.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Akin to Udmurt  (vuyny).\n","From Proto-Finno-Ugric *waje.\n","From Proto-Finno-Ugric *wue. Cognates include Eastern Mari  (u), Finnish uusi and Hungarian j.\n",null,null,"From Proto-Permic [Term?], from Proto-Uralic *kne. Cognates include Finnish kynsi and Hungarian krm.\n",null,null,null,null,null,null,null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,"From a Permic *kid, from Proto-Uralic *kte.\n",null,"From Proto-Uralic *ket, like Udmurt  (kezyt).\n","From Proto-Permic [Term?]. Cognates include Komi-Permyak  (kok).\n",null,"From Proto-Permic [Term?]. Cognates include Komi-Permyak  (kor) and Udmurt  (kuar).\n","From Proto-Finno-Ugric *ker-. Cognates include Hungarian kr.\n",null,"From Proto-Permic [Term?] (hare). Cognates include Udmurt  (ke). The name of the month was given due to September being the hunting season on the hares.\n",null,"From Proto-Uralic *kale-. Cognates include Udmurt  (kulyny).\n",null,null,"From Proto-Turkic *ku (bird).\n","From Proto-Permic [Term?], from Proto-Uralic *kle. Cognates include Finnish kieli and Northern Sami giella.\n","From Proto-Uralic *kule-.\n",null,null,null,null,null,"From Proto-Permic [Term?], from Proto-Uralic *lewle. Cognates include Finnish lyly (steam) and Northern Sami lievla (steam).\n",null,null,null,null,"From Proto-Permic [Term?], from Proto-Finno-Permic *lowna (day, midday). Cognates include Finnish lounas and Udmurt  (nunal). The sense for the compass point emerged from the position of the Sun on the given time of day.\n",null,null,null,null,null,null,null,null,"From Proto-Permic *mu, from Proto-Uralic *mxe. Cognates include Finnish maa and Mansi  (m).\n",null,null,null,null,null,"From Proto-Permic [Term?], from Proto-Uralic *nejde. Cognates include Finnish neiti and Northern Sami nieida.\n",null,"From Proto-Permic [Term?], borrowed from an Iranian language, ultimately from Proto-Iranian *nagna- (compare Persian  (nn)). Cognates include Komi-Permyak  (njan) and Udmurt  (njan).\n",null,null,null,null,null,"From Proto-Permic [Term?], from Proto-Uralic *pojka. Cognates include Finnish poika and Hungarian fi.\n","(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)","From Proto-Uralic *pele-.\n",null,"From Proto-Uralic *pe.\n",null,null,"From Proto-Permic *po, from Proto-Uralic *puwe. Cognates include Finnish puu and Hungarian fa.\n",null,null,"From Proto-Permic [Term?], cognate to Udmurt  (pyryny).\n",null,null,null,null,null,null,"From Proto-Permic [Term?], cognate to Udmurt  (sjotyny).\n",null,null,null,null,"From Proto-Finno-Ugric *sula.\n",null,"From Proto-Permic [Term?], from Proto-Uralic *tuxli. Cognates include Finnish tuuli and Udmurt  (tl).\n","From Proto-Permic [Term?], from Proto-Uralic [Term?]. Cognates include Eastern Mari  (tylze) and Udmurt  (tolez).\n","From Proto-Finno-Permic *teje, compare Estonian tee and Finnish tie.\n","From Proto-Permic *turn, from Proto-Finno-Permic *tarna, borrowed from Indo-European, from Proto-Indo-European *trns. Cognate with Udmurt  (turyn), Finnish taarna.\n",null,null,null,null,"From Proto-Permic [Term?]. Cognates include Komi-Permyak  (ud) and Udmurt  (u).\n",null,null,null,null,"From Proto-Permic [Term?], cognate to Udmurt  (eskyt).\n",null,null,null,"From Proto-Permic [Term?], cognate to Udmurt  (uyny).\n",null,null,null,null,null,"Akin to Finnish hein.\n",null,null,"From Proto-Finnic *ni, from Proto-Finno-Ugric *ne. Cognates include Finnish ni and Veps n'.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Finnic *mendk, from Proto-Uralic *mene-. Cognates include Finnish menn and Estonian minema.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Finnic *poika, from Proto-Uralic *pojka. Cognates include Finnish poika and Estonian poeg.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Finnic *toinen. Cognates include Finnish toinen and Estonian teine.\n",null,null,"From Proto-Finnic *t. Cognates include dialectal Finnish ty and Ingrian t.\n",null,"From Proto-Finnic *uni, from Proto-Finno-Permic *une. Cognates with Finnish uni and Estonian uni.\n",null,null,null,null,null,null,null,"Akin to Finnish varoa and Veps varaita.\n",null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,null,null,null,null,null,null,"From Proto-Indo-European *herko- (bow, arrow). Cognate to Old English earh, whence English arrow.\n",null,null,null,null,null,"Uncertain origin, proposed connection to Ancient Greek  (kibts).\n",null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Italic *frustom, from Proto-Indo-European *brus-ts, from *brews- (to break up, cut).\n",null,null,null,null,null,"From a dissimilation of earlier *meddis, derived from medius (middle) + dis (day).\n",null,null,null,"From Proto-Italic *s, from Proto-Indo-European *hhos. Cognates include Hittite  (ai), Sanskrit  (s), Old Irish .\n","From Proto-Indo-European *pak-slo-, from root *peh-. See pang, pgus, pacscor, px, pgina.\n",null,null,null,"From post + ea (these things).\n","From Proto-Indo-European *phweros, from *pehw-. Cognate with Oscan  (puglum), Ancient Greek  (pas, child).\n","Unknown. Possibly from earlier polcher, which according to Walde-Hoffman and Pokorny reflects Proto-Indo-European *per- (motley, variegated), with dissimilation *per-ro-s > *pel-ro-s, which would make it cognate to Sanskrit  (pni). De Vaan rejects that connection as both irregular and semantically incompatible/tenuous, and assigns no known etymology.\n",null,null,null,"From Proto-Indo-European *wrhds (root) and cognate with rdx.\n",null,null,"From re- + *-tr, probably taken from intr and other similar adverbs.\n",null,null,"From saccus (a sack, bag, purse) + -ulus (diminutive suffix).\n",null,null,"The origin is uncertain. Perhaps from Proto-Indo-European *th-dlom, from *teh- (to stand) (a variety of *steh- without s-mobile, whence also Latin st, stre (to stand)) + *-dlom (instrumental suffix) whence Latin -bula. The original meaning would then be that which stands, for which see also Latin stabulum.\n",null,"From Proto-Italic *terz, from Proto-Indo-European *ters-eh, from *ters- (dry). Cognate with torre, Ancient Greek  (trsomai), Old Irish tr, Sanskrit  (tyati), Old English urst (English thirst).\n",null,"From Proto-Italic *ungus, from Proto-Indo-European *hneg-. Cognates include Ancient Greek  (nux), Old Irish inga, Sanskrit  (nakh, claw, nail), Old Armenian  (eungn), Old Church Slavonic  (nogt), Lithuanian nagas, Persian  (nxon), Albanian nyell, and Old English nl (English nail).\n",null,"Most likely related to vrus (bandy).\n",null,"(Can this(+) etymology be sourced?)\nFrom Proto-Baltic *d-, from Proto-Indo-European *hed-, a parallel form of *he- (goat) (whence Latvian zis (billy-goat), q.v.). The term may originally have been adjectival (cf. Lithuanian dinis (skin, of skin)). A relationship between terms for goat and skin is not infrequent in Indo-European; cf. Russian  (koz, goat),  (ka, skin), or Sanskrit  (aj, she-goat),  (ajnam, skin). In Latvian, the term expanded its meaning to cover both human and animal skin (or fur), as well as animal skin as material for making objects, ideas often distinguished in other languages (e.g., German Haut, Fell, and Leder). The original meaning is perhaps preserved in the Finnish borrowing vuota ((raw) hide, pelt). Cognates include Lithuanian da, Sanskrit  (tka, armor, outfit) (< *he-ko-), Ancient Greek  (asks, leather wine-skin), Albanian dhi (goat) (< *hed-i).",null,null,"The usual theory considers ala to be borrowed from Middle Low German hol (depth, hole, cave), or maybe from the same form in Middle Dutch or German Low German (East Frisian); cf. German Hhle (cave).\nA different view suggests that ala could also reflex of an old Proto-Indo-European stem *hel-, *ol-, *al- (to flow, to drain) with various Baltic reflexes: dialectal alots, alogs, standard avots ((water) source), alksna, aluksna (miry, swampy place) (cf. place names like Alksne, Alkstes), Lithuanian alti (to flow, to drip). The original meaning of ala would thus have been (water) source, from which place (e.g., cave, rift, pit) from which water springs and finally simply cave, possibly under the influence of the aforementioned Germanic words.",null,"From at- + stt",null,"Traditionally derived from Proto-Baltic *pek- (metathesized to *kep-), from Proto-Indo-European *pek- (to roast, to cook), from earlier *h-p-k-, *hp-k-. Karulis would rather see *pek- as a metathesis of PIE date of a root *kep-, *kep- (to smoke, to cook), formed analogically from *tep- (to be hot, to heat up) on the model of *kel-, *tel- (to build). Cognates include Lithuanian kpti, Old Church Slavonic  (peti),  (pek, 1 sg. pres.), Russian  (pe),  (pek), Belarusian  (pjekc), Ukrainian  (pe),  (pekt), Bulgarian  (pek, 1st sg. pres.), Czech pci, Polish piec, Sanskrit  (pcati, to roast, to bake, to cook, to boil), Ancient Greek  (pss, to bake, to cook, to boil) (from *pekye-), Latin coqu (to cook, to roast, to dry), Tocharian A, Tocharian B pk- (to cook, to boil).","Originally the iterative counterpart of an earlier verb *dert (to tear, to split), from Proto-Baltic *der-, from Proto-Indo-European *der- (to split, to tear, to peel). The meaning evolved as follows: to tear, to split > to cut, to chop (wood) (cf. the derived form darint kokus to pear, to cut (branches) off (a tree)) > to make by cutting (e.g., like a carpenter) > to make, to do. Cognates include Lithuanian darti (to do, to make).","From daudz (much, many, a lot) + -ums.\n",null,"From the same stem as dzvs (q.v.), made into a regular second conjugation verb (ending -ot). It replaced an earlier dzt (to live) (q.v.), of which it may have originally been the iterative form (in case it was not directly derived from dzvs). Its original meaning, to be alive, to exist, was later extended to include also to reside (like English to live); cf. the derived term dzvoklis (apartment, flat).","From the same stem as the adjective gatavs (ready) (q.v.), made into a regular 2nd-conjugation verb.","From earlier *grenz-, from Proto-Baltic *gren-, from Proto-Indo-European *gren-, from the zero grade of Proto-Indo-European *ger- (to turn; to wind; to wreathe) with an extra  and an infix -n-. A minority opinion considers griezt (to turn) to have the same origin as griezt (to cut) (see below), with the circular motion meaning coming from certain ways of cutting. Cognates include Lithuanian grti (to drill, to turn, to change, to mend), Old Prussian granstis (one who drills, who drilled), greanste ([grnste], rope made of woven, wound branches), Old Norse kringr (ring), kringla (ring, circle), kranga (to crawl, to creep, to drag oneself), German Kringel (pretzel), Dutch krinkel (loop; twist).","From the same stem as the verb gult (to lie down) (q.v.), of which it was originally the iterative (and possibly causative) form. Originally it was an i-stem, as can be seen in dialectal forms like gulim, gulit instad of guam, guat. Cognates include Lithuanian gulti, Sudovian guld (< *gult).","The infinitive and present tense forms come from Proto-Baltic *eitei, from Proto-Indo-European *hey- (the old athematic present tense forms *eimu, *iemu, etc. were lost and replaced with new forms derived directly from *hey-). The past tense forms come from Proto-Baltic *g-, from Proto-Indo-European *geh- (to come), from which also Lithuanian gti (to go quickly), English come).\n","From Proto-Balto-Slavic *jauns, from Proto-Indo-European *hywH. In Latvian, this word broadened its meaning to include also new, replacing a previous *naujs (new) (compare Lithuanian najas (new)). Cognates include Lithuanian junas (young), Old Prussian *jaun- in names of people (Jawne, Javne, etc.), Sudovian iaunis, Old Church Slavonic  (jun), Russian  (jnyj), Ukrainian  (junyj), Czech jinoch (young man), Gothic  (juggs), German jung, English young, Sanskrit  (yvana), Latin iuvenis.\n","From Proto-Baltic *ky-a, from Proto-Indo-European *ki-, a stem of unclear origin. It is possible that the initial *k is an irregular reflex of an earlier *g, in which case Latvian kja and its cognates might be derived from Proto-Indo-European *g- (to come, to go); compare Latvian kja: gja (he went) with Sanskrit  (kya, body, flesh):  (gja, gait, motion). Another hypothesis suggests a connection between Latvian kja and Ancient Greek  (k, to go),  (kin, to move, too put in motion), Latin cie (to move). Cognate include Lithuanian koja, Sudovian kaj ([kj(a)]), Sanskrit  (kya, body, flesh).",null,"From Proto-Balto-Slavic *kas","From Proto-Baltic *kuok-, from Proto-Indo-European *kewk-, from the stem *kew- (to bend, to be bent). \nMeaning at first bent wood, branch, stick, it soon became wood, tree. It competed with mes (< *medis), the original term for wood, tree, which soon acquired the meaning of forest. The original branch, stick meaning of koks can still be occasionally found (see below). \nCognates include Lithuanian koka (stick with thick end, pounder, pestle), kokas (stick with thick end; thick end of a stick; tuber; mace, club), kuk (stick), Bulgarian  (kuka, spike, peg, wedge, hook, handle).",null,null,null,null,"Cognate with Lithuanian laikas.\n",null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,null,null,null,null,null,null,null,null,null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)","From Proto-Baltic *lep-, *lp- (whence both slpt and its dialectal variant slept), from Proto-Indo-European *lep-, *lp-, a variant of *klep- (related to the stem *gleb()- (to cover, to squeeze), whence Latvian glbt, q.v.).The original meaning was to cover (with one's hands), from which to not let others see (by covering with one's hands) > to hide. Cognates include Lithuanian slpti; from the parallel stem *klep-, also Old Prussian auklipts (hidden), Gothic  (hlifan, to steal), Ancient Greek  (klpt, to steal) (< *klpy-), Latin clep (to steal, to listen secretly).",null,"See var.\n","From Proto-Baltic *wardas, a masculine parallel form to neuter *wardan, from Proto-Indo-European *werdhom (word), from the stem *werh- (to speak, say, talk) with an extra element -do. Note the typical Baltic polysemy between name and word, since the Proto-Indo-European term for name, still conserved in Old Prussian emnes, emmens (< Proto-Indo-European *hnmn), was lost and replaced by *werdo-. Cognates include Lithuanian vardas, Old Prussian wrds, wirds, Sudovian ward, Russian  (vrat, to lie), Belarusian  (vjarzc, s/he lies), Ukrainian  (verzt, to lie), Proto-Germanic *wurd (Gothic  (waurd), German Wort, English word, Icelandic or), Hittite urt- (to load, to charge) (: weriya- to say), Sanskrit  (vrata, vow, command), Ancient Greek  (er, to say) (< *wery), Latin verbum.",null,"From Proto-Balto-Slavic *em, compare zem, ultimately from Proto-Indo-European *dm. Compare Lithuanian m, Polish ziemia, Russian  (zemlj), Persian  (zamin) Latin humus, Ancient Greek  (khthn).\n",null,null,null,null,null,null,"Compare with Avar  (ar).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Northeast Caucasian *hwnV (blood); compare Akhvakh ,  (hini, h, blood).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Turkic *b(k) (five). Cognate with Kazakh  (bes), Krymchak , Kyrgyz  (be), Turkish be, Karakhanid  (b, five), Old Turkic  (b, five).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Balto-Slavic *beg-; cognate with Latvian bgt, Proto-Slavic *bi (to flee, run). From Proto-Indo-European *bgeti, from Proto-Indo-European *beg- (run, flee), with long vowel due to Winter's Law. Cognate with Ancient Greek  (phbomai, flee, take flight). Possibly also Tocharian A pukl, Tocharian B pikul (year).\n",null,null,null,null,"Compare Polish verb dziery (to hold).\n",null,null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)","From Proto-Indo-European *gew(H)- (to gain), see also Latvian gaut (to catch, gain), gvejs (winner).","Compare Old Prussian geguse (cuckoo) attested in Elbing Vocabulary.\n","From Proto-Balto-Slavic, from Proto-Indo-European *gen-. Cognate with Latvian dzt, Old Prussian guntwei, Polish gna (to rush), Ancient Greek  (then, to kill) and Sanskrit  (hnti, to slay). See also ganti (to graze).\n",null,null,null,"From Proto-Baltic *jg, from *ygeh (power, youthful strength). Cognates include Latvian jga (meaning, sense, point), Ancient Greek  (hb, power, youthful strength).\n","From Proto-Indo-European *kelh- (to shout), which is imitative. Related to Old English hlowan (to low, make a noise like a cow), Old High German halan (to call), Ancient Greek  (kledon, report, fame),  (kls, to call),  (klados, noise), Middle Irish cailech (cock), Latin cal (to call out, announce solemnly), Sanskrit  (uakala, cock, literally dawn-calling).\n","Per Derksen 2008, from Proto-Balto-Slavic *kampta.  Also compare Proto-Celtic *kantos (corner).\n",null,null,"From Proto-Balto-Slavic *kas, from Proto-Indo-European *kos.\n","From Proto-Indo-European *pek-. The current Lithuanian form has experienced metathesis. Cognate with Russian  (pe).\n",null,"Compare Latvian ciets.\n",null,null,null,null,"Cognate with Old Prussian quoi (I/you want), Old East Slavic  (svt, world; society), Latin quaero (I look for).\n",null,null,null,null,null,"From Proto-Balto-Slavic *mink-. Cognate with Latvian mksts, Polish mikki.\n","Within Balto-Slavic a connection can be drawn with Latvian mustavas (warping beam) (compare mutvas); Slovene maiti (fill, clog up) and perhaps Bulgarian  (ma, stab, poke) < *moux-. These forms point to Proto-Indo-European -s- and a root of *mews- (poke, beat); compare Sanskrit  (muti, steal, break).\nAccording to Beekes, the root is *hmu-; compare Ancient Greek  (amss, scratch, tear), Latin mcr (sharp point). However, neither the semantic nor formal arguments make a convincing case for the Lithuanian term to belong here.\n","From Proto-Balto-Slavic *noga, from Proto-Indo-European *hnog-eh.\n",null,"Compare Latvian da.\n","Probably related to Proto-Germanic *hulaz (hole), from Proto-Indo-European *el- (to cover).","From Proto-Indo-European *horh-on- (shore, bank, border).\n",null,null,null,null,null,null,"From Proto-Balto-Slavic *prtan. Cognate with Latvian pirksts, Old Prussian pirsten and Proto-Slavic *prst. Compare also Sanskrit  (ph, back).\n",null,null,null,null,null,null,null,null,"Probably cognate with Latvian pst.\n",null,null,null,null,null,"Cognate with Latvian slpt.\n",null,null,"Cognate with Latvian skt (start, begin). Frequently connected with Old Church Slavonic ,  (skakati, ska, hop, jump),  (skoiti, jump, leap), Proto-Germanic *skehan (spring up, emerge). If so, we could be looking at a Proto-Indo-European s-mobile *(s)ehk-, *(s)ohk-, with the palatovelar present in the Baltic forms (< *ok-) being neutralised after s in Slavic (< *skok-).\n",null,"Compare Latvian stiprs.\n",null,"From Proto-Balto-Slavic *suk- (turn, spin); compare Latvian sukt, Proto-Slavic *skati (Russian  (skat, twist, turn), Czech skati). Also related are Latvian suct, Proto-Slavic *suiti. Beyond Balto-Slavic, hesitant connections have been made with Tocharian A kr, Tocharian B akr (at the back), Ossetian  (xrx, whey), Latin sucula (winch).",null,null,"From Proto-Balto-Slavic *tek-, from Proto-Indo-European *tek-. Cognates include Latvian tect, Serbo-Croatian /tei (to flow), Sanskrit  (tkti, to rush) and Old Irish techid (to flee).\n",null,null,null,null,null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,null,"From Proto-Indo-European *elh-. Cognate with Latvian za (green) and akin to Proto-Slavic *zelen (green), *zelje (young vegetation).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Sanskrit  (graha, inclination towards, whim).\n",null,null,null,null,null,null,null,null,null,"Cognates with Tamil  (ku), Kannada  (gi), Telugu  (gli).\n",null,null,null,null,null,null,null,null,null,null,"Cognate with Kannada  (t), Tamil  (t).\n",null,"From Sanskrit  (nakha).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Dravidian *vu. Cognate with Kannada  (bu, house), Tamil  (vu)",null,null,null,null,null,null,null,"According to Feoktistov, from a Turkic language. Verinin considers suggestions of borrowing completely baseless, he is convinced that the term is of child language origin (its original meaning being \"mother\"), according to him, the following are of a similar origin: Eastern Mari  (ava), Western Mari  (v), cf. dialectal Eastern Mari ! (appa!, [an exclamation for a baby to smile]), Tundra Nenets [script needed] (ppa, mother [child language]). Parallel developments in unrelated languages: Selkup  (mother), Basque ama (id.), Nivkh  (mk, id.), Koryak [script needed] (-aw'-) in [script needed] (aw'gyjnik, female [animal]).",null,null,null,"Ultimately from Proto-Uralic *la. Perhaps by error EES lists Moksha  (al, egg) as a cognate of Estonian ala. Compare, however, Estonian alus (foundation), Livonian al (down; under), alli (foundation; underside), among others. Verinin, however, lists the lower part of something as an alternative sense for the word  (al) in both Mordvinic languages. He speculates that the egg sense is secondary to the underside sense (as eggs are found under birds), a possible taboo replacement, as collecting eggs in the spring was very important in historic times.",null,null,null,null,null,null,null,null,"According to SSA, relationship with Finnish vaania is uncertain. According to others, the two terms are unrelated.(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,"Cognate with Erzya  (veltjams).\n(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,null,"From Proto-Mordvinic *vi. Cognates include Erzya  (vir).\n",null,null,null,null,null,null,null,"From Proto-Uralic *kanta-. Cognates include Erzya  (kandoms), Northern Sami guoddit, Finnish kantaa, Eastern Mari  (konda).",null,null,null,null,null,null,null,null,"Cognate with Erzya  (ki). This term is to be linked with Eastern Mari  (kya, footprint), Finnish keino (way (of doing something)). Verinin thinks that the origin could be the old pronoun *ki (this), a correspondence k-/t- then would explain Estonian tee (road), Finnish tie (id.), Komi  (tuj, road; footprints; direction).",null,null,null,null,"From  (korxtams, to speak) + - (-ma).\n",null,null,"From Proto-Uralic *kota. Some speculate borrowing from Proto-Indo-European *kotho-, whence Persian  (kad). Phonologically and semantically similar terms can be found in other language families: Tungusic Evenki  (koton), Dravidian Tamil  (kui), Ainu  (kot, building site; place).",null,null,null,null,"From Proto-Uralic *kle. Cognates include Finnish kieli, Estonian keel and Northern Sami giella.",null,null,null,null,"Verinin considers this term evidently connected with  (ilja, other, different), the latter being the original form, the root - (i-) is of the same origin as  (isen, of yesterday [adjective]) and  (ikoze, far), - (e-) in Erzya  (ezk, close, next to),  (eske, last time), he compares -- in Tundra Nenets [script needed] (eli, other, different), [script needed] (elim, to become different), Udmurt  (iskan, close female friend, close relative) and Eastern Mari ()- ((v)je-) in () (ves(je), other) (where - (v-) might be a secondary development.) In relation to the last ones, he also compares Proto-Turkic [Term?] (e, friend).\nIn the Erzya word  (ilja, don't [imperative of negation verb]) Verinin sees shifting of meaning from \"that (one)\"  \"not (that one),\" where the - (i-) originally has been a demonstrative component, the same as in the Moksha term.",null,null,"From Proto-Uralic *luke-.",null,"Cognate with Erzya  (marjams).\n(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,null,null,"From Proto-Uralic *mua (earth, land), whence also Finnish muta (mire, mud). According to Verinin, other cognates may include Eastern Mari , ,  (modo, mudy, muto, blueberry), perhaps the element - in Erzya  (botavoms, to become turbid, muddy [of water]), the element - in ,  (butra, putra, turbid, muddy).\n","From Proto-Finno-Ugric *mule-. Cognates include Erzya  (molems), Northern Sami mollat, Hungarian mlik.",null,null,null,null,null,null,"From Proto-Uralic *pala-.\n",null,"From Proto-Uralic *pe.","Ultimately from Proto-Uralic *pele-. Cognates include Finnish pelt, Northern Sami ballat, Hungarian fl.Verinin is unsure whether development from  (pjal, half; side) is possible, he wonders if the meaning could have changed from \"side\" to \"step aside; avoid; fear.\"",null,null,null,null,"From Proto-Finno-Ugric *per. Cognates include Erzya  (prja), Finnish per, Komi-Zyrian  (br), Udmurt  (ber), Khanty  (prtg), Mansi  (pr).",null,null,null,"From Proto-Uralic *pl (half; side). The sense of the postposition apparently evolved from \"side\" to \"by the side of.\"\n",null,null,"Cognate with Erzya  (sams).\n(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,null,null,"Cognate with Erzya  (sergedems).\n(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,null,null,null,null,null,null,null,"Cognate with Erzya  (seredems).\n(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)","Cognate with Erzya  (tujems).\n(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,null,null,null,null,null,null,null,null,"From Proto-Uralic *ke.",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Uralic *ojwa.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Finno-Ugric *kte.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Cognate with Western Mari  (tng).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Borrowed from English beer.\n",null,null,null,"A Berberborrowing, originally spread in African Latin and then gradually replacing the native ulva, compare Kabyle tabuda (Typha angustifolia) etc., also Arabic  (burdiyy),  (b, cattail) from which some forms have later been reborrowed into Romance, listed there. There is an interpolation in the Dioscurides locus about  (thapsa) after   saying that the Africans call it  (boidn) ( , left out in Dioscrides interactivo), which mirrors a Berber collectivemorpheme -n (as explained by Bertoldi 1947 p.195 seq.).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Borrowed from Italian or Spanish gala",null,null,null,null,null,null,null,null,null,null,null,null,null,null,"guru + -n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From -fa (die).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Uralic *witte (five). Cognates include Khanty  (wet), Hungarian t, Finnish viisi, Estonian viis, and Nganasan  (b, ten).\n",null,null,null,null,null,null,"From Proto-Finno-Ugric *waje (fat). Cognates include Hungarian vaj.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Uralic *mxe. Cognates include Finnish maa, Komi-Zyrian  (mu), Udmurt  (mu), possibly also Khanty  (mw).\n","From  Proto-Ob-Ugric *megl, from Proto-Finno-Ugric *mlke (breast). Cognates include Hungarian mell.\n",null,null,"From Proto-Uralic *mene- (to go).  Cogna . Compare to English har / English harr",null,"Probably from Old Occitan guidar, from Frankish *wtan (to show the way, lead), from Proto-Germanic *wtan (to see, know; go, depart), possibly through a Medieval Latin intermediate. Compare Portuguese guiar, French guider (Old French guier), Old Occitan guidar, Italian guidare, English guide.\n",null,null,"From limpio, or from a Late Latin limpidre, from Latin limpidus. Compare Portuguese and Galician limpar, Asturian llimpiar.\n","From Old Spanish cras maana or mannana (literally tomorrow morning), from Vulgar Latin *mnena, from Latin mne, from Proto-Indo-European *meh-. Compare Portuguese manh.\n",null,"From Latin molestre, from molestus (troublesome).\n","From Old Spanish, from Vulgar Latin *pass (present infinitive Vulgar Latin *passre), from Latin passum, supine of pando (I stretch, I spread out). Compare English pass, Italian passare, French passer, Portuguese passar.\n",null,null,null,null,"From Old Spanish rico, borrowed from Gothic  (reiks, mighty, powerful), from Proto-Germanic *rkijaz, from Proto-Celtic *rxs, ultimately from Proto-Indo-European *hrs.\n","sucio + -edad; cognate with Galician sucidade, Portuguese sujidade.\n",null,"From tapa (lid, cover) + -ar.\n","From Medieval Latin, from Vulgar Latin *tir, tirre, of unknown or uncertain etymology. Possibly from Gothic * (*tiran), from Proto-Germanic *teran or alternatively Late Latin *martyrre, possibly with influence from Latin trah. Cognate with English tier. Compare English tear.\n",null,null,null,null,"From bashk (together, simultaneously) + -oj verb suffix.\n","From archaic and dialectal bnj (to make appear; do, make), from Proto-Albanian *banja, from Proto-Indo-European *bh-n-y-ti, from *beh- (shine) (compare Greek  (fanomai, to seem, appear).","From dialectal bjej, from Proto-Albanian *bera, from Proto-Indo-European *berH- (to strike) (compare Old English berian, Latin ferre).\n",null,null,null,null,null,"Aphetic form of dialectal ndgjoj, from Old Albanian ndiglonj (Buzuku), from Proto-Albanian *jgnja, a derivative of gjoj. Compare Old High German jagon (to hunt). More at gjoj.\nFrom earlier ndiglonj, from Proto-Albanian *intellegnj, borrowed through Vulgar Latin from Latin intelleg (I understand). Compare Romanian nelege.\n",null,null,null,"From *ets (compare dialectal ecj), from Proto-Albanian *aitatja, from Proto-Indo-European *hyti, present of *hey-. Compare Serbo-Croatian i, Lithuanian eti. See heci.\n","Origin disputed. Either from Latin aere (air), (already reflected in Albanian ajr) or from Proto-Indo-European *hey- (to go), influenced by ajr.\n","From fill + -oj verb suffix.\n",null,"Borrowed from Latin fortis.\n","According to Orel, from Proto-Albanian *sprgnja, etymologically connected to Lithuanian sprgstu, sprgti (to escape, get out) and Proto-Slavic *prygati (to spring, jump).\nEarlier form might have been *fnyj, from *pnyj,(Can this(+) etymology be sourced?) from Proto-Albanian *pnewa, hence from Proto-Indo-European *pnew-. Compare Ancient Greek  (pn, I blow). A similar development p- > f- happened to ftoh, from Old Albanian ptoh.\n",null,null,"From dialectal Tosk pshij, pshinj, from Proto-Albanian *bs-in-je/o-, from Proto-Indo-European *bes- (rub) (compare Old High German besamo (broom), Ancient Greek  (ps, I rub), English berry).\n",null,"From Old Albanian gluh (language, tongue), from Proto-Albanian *glux, from earlier *guls, from pre-Albanian *glso-, zero-grade of Proto-Indo-European *gols-o- (compare Proto-Balto-Slavic *galsas (voice), Proto-Germanic *kalzn (to call)).\n","From Serbo-Croatian goditi (to please), pogoditi (I hit).",null,null,null,"From dialectal and archaic helq, from Proto-Albanian *(w)alkja, from *hwolkye-, causative of Proto-Indo-European *hwelk- (to pull) (compare Lithuanian velk, Bulgarian  (vlek, to drag), Greek  (avlki, furrow)).\n",null,null,null,null,null,"From Proto-Albanian *kapa, from Proto-Indo-European *kehp-. Cognate to (Baltic) Latvian kmpju, kmpt; Proto-Celtic *kawnos (Old Irish can, Irish cuan, Scottish Gaelic cuan); Proto-Germanic *habn, Proto-Germanic *habjan (to have, lift); Proto-Hellenic *kap (Ancient Greek  (kpt)), Proto-Hellenic *kp (Ancient Greek  (kp)); Proto-Italic *kapi (Latin capi) and (perhaps) also Old Armenian  (xap), Old Armenian  (xapanem) (perhaps) and Latin capsa. Possibly also an ultimate doublet of kopsht.\n",null,"From Proto-Albanian *kakja, from Proto-Indo-European *kaw- (compare Ancient Greek  (kaks, bad), Lithuanian keti (to be evil).\nFrom Proto-Albanian *kakiia / *kakii, compare Ancient Greek  (kaks, bad).\n","A derivative of krcas, originally meaning 'to crack, to snap', thus 'to jump, to dance'. A descriptive term.\n",null,"Prefixed derivative of thyej (to breach, break).\n","Deverbative of kthej (to turn).\n","From Proto-Albanian *ka-ei, based on a pronominal element *ka and a demonstrative (see ai).",null,null,null,null,"From Proto-Albanian *elaiwanja, based on *elaiw, borrowed from Ancient Greek  (laion, oil).",null,null,"From mbanj (Arbresh), from *nbanj (compare Old Gheg nbaj), from Proto-Albanian *en- (an intensive prefix) + *barnja, causative of *bera (modern bie). More at bie.\n","According to Meyer and Tagliavini from mbar (I bring (back)) (mbar + -oj). Related to Albanian mbar (good, right, complete, wholly, etc.), further related to mbart (I bear, carry (back)), Albanian mbaj (I hold, carry) and bie (I bring).Orel proposed it as a (prefixal) derivative of par.A formation with the verbal suffix -o-, from Proto-Albanian *-- (from *-eh-).(Can this(+) etymology be sourced?)","From older mbledh, from Old Albanian nbljedh, from Proto-Albanian *ambiledza, compound of *ambi (on, over) (modern mbi) + *ledza, from Proto-Indo-European *le- (to gather) (compare English leech (doctor), Latin legere, Ancient Greek  (lg)).\n",null,"Compound of mbi + roj (guard), from ruoj (to guard, to keep). Related to mburoj. According to Orel, borrowed from a Romance language (compare Italian imparare).","From mbi (on, upon) + ul (to lower, put down), from Proto-Albanian *ambi-wla, from Proto-Indo-European *wel- (to press together), probably a secondary formation after mbyll (close, shut down). See mbyll and ul.\n",null,null,"From *ndrr, from Proto-Albanian *anteros, from Proto-Indo-European *an-2 (there, on the other side). Cognate to Old Prussian antars, anters (other, second), Lithuanian atras and Old High German andar (other).\n",null,null,null,null,"Ultimately from Latin pcre. Source language is uncertain, as is the possibility of a direct borrowing. Possibly from Italian pagare or alternatively a derivative of pag, also from Italian.\n",null,"From prap, from Proto-Albanian *per apa, *pra apa, the second element being identical with pa.",null,null,"The current form is a participle of an obsolete form *poj, which is a zero-grade suffixed derivation of *hep- (to work). Relationship with Hittite [script needed] (appina, to become rich) is unclear, even though there have been cases in which an older -i- has become a -u- (ahu (beech) is also attested as ahi in older dictionaries), making it possible for this word to have been *pina with a different meaning.\nAlternatively a derivative in -n of an unused verb *puaj, continuing Proto-Albanian *pnja. The latter is related to Ancient Greek  (pnomai, to strain, work on) and its deverbative  (pnos), with uncertain further links.",null,null,null,null,"See active voice form rris (to rear, grow).\n","Variant of ruoj.\n","From sa.\n",null,"According to Orel, borrowed through Vulgar Latin from the deponent Latin sequor (to follow), in particular oculis sequor (\"to follow with eyes\").\nUltimately a doublet of shoh via Proto-Indo-European.\nHowever, abej deems it a word which has come fairly recently into usage, unlike the ancient borrowing Orel proposes. It is lacking in the Meshari of Buzuku completely, and also in certain dialects in Southern Albania and in Italy and Greece it's nowhere to be heard. This leads to the assumption that it's not a very old term, thus a potential Latin origin disputable. Possibly an enlargment with the verbal suffix -oj.\n","Syncope of shtekoj (to set out, take to the road), Gheg variant of shtegoj, denominative verb from shteg (path, trail).","From sh- (mobile suffix) + ngrij.\n","From Proto-Albanian *staiga, from Proto-Indo-European *stygos (way), from *steyg-. Cognate to Ancient Greek  (stokhos, line, row), Gothic  (staiga, way), Latvian staga (walking).\nFrom earlier shtek, from Proto-Albanian *taigh, from Proto-Indo-European *stygos < *steyg- (to climb).\n","Through Vulgar Latin, from Latin hospitium; compare Ancient Greek  (hosption) (modern Greek  (spti)).","From archaic and dialectal shtynj, from Proto-Albanian *stdnja, from Proto-Indo-European *(s)tewd- (push, thrust) (compare German stoen, Latin stude).\n","Apocope of *thuan, from Proto-Albanian *(a)tsna, or *hai, from Proto-Indo-European *he- (sharp) (compare Lithuanian ans (blade edge), Ancient Greek  (kanos, pine thistle), English awn (bristle of barley)).\n",null,"Mediopassive of ul (I lower); ul (I lower) + -em (myself)  meaning I sit down.\n","A formation in -s of Proto-Albanian *awa-deja, from earlier *dej, continuing Proto-Indo-European *dhu-. Compare Old Church Slavonic  (daviti, suffocate), Gothic  (ahdauis, tormented), Old Irish dth (end, death), Avestan  (duuaid, we press).\n",null,null,"From Proto-Albanian *wesi, from earlier *usi, from Proto-Indo-European *hws- and dual ending *-ih. Cognate with Lithuanian auss (id), Ancient Greek  (os), Latin auris. According to Witczak, it is the source of Doric Greek  (baessa).\n",null,null,null,null,"Compound of an (on, at) + tnda (to ignite, light). Similar compounds can also be found in other Germanic languages; compare German anznden, Norwegian antenne.\n",null,null,null,"Apocopic form of bliva, from Old Swedish bliva, from Middle Low German blven (to remain), from Old Saxon bilvan, from Proto-West Germanic *bilban, from Proto-Germanic *bilban.\n"
